(91, 'Bling My Thing Vogue Back Case For Apple iPhone 6 Plus - Gold', '', 'The Cascade Collection takes Bling My Thing back to its root: pure luxury BLING! The Brilliant series offers beautiful gradation designs brought by our Chief Designer, Ayano Kimura. The way she mixes 3 crystal colors is truly magical. 567 pieces of SS9 Xilion Rose crystals (2.6mm) are embedded individually to create the maximum light refraction while allowing colors to change subtly from top to bottom. Ayano chose various combinations of colors for the Brillian series but this Brillian Gold design takes the the concept of gold to the next level by incorporating two of the special coated crystals,  Crystal Golden Shadow and Crystal Moonlight, she managed to create subtle, mysterious shimmering effect on the crystal surface. The result is pure elegance. The background case color also changes in color from top to bottom, matching the crystal colors.\n', '', 1, 14900, '11920', '', NULL, NULL, NULL, '', NULL, '', 1, 1, 'IP6-I-VG-GIG-IGM', 'Gold', '', '', 'Back Case, Hard Case', 'Phone', 'Apple iPhone 6 Plus', '', 'Gold', '', '', '', '', '', '', '1', '', '', 'Vogue', '', '', 'No Warranty', '', '', '', '', '', '', '', '', '', 'Vogue 6 Plus', '', '', '', '', 0, ''),
