(132, 'iLuv Vyneer Back Case For Apple iPhone 6 - Black', '', 'Simple and streamlined, Vyneer gives your iPhone a clean, understated look without skimping on protection.  Featuring a polycarbonate base and a soft TPU frame around the edges, Vyneer keeps your phone safe from dings, scratches and dents.\n \nDual Material Protection\n \nVyneer offers a simple but effective combination of hard polycarbonate shell and soft TPU (thermoplastic polyurethane) frame to protect your iPhone. The polycarbonate shell protects the bulk of your phone from drops and falls, while the TPU frame shields the corners and edges from dings, scratches and dents.\n \nShow Off Your Phone', '', 1, 1299, '', '', NULL, NULL, NULL, '', NULL, '', 0, 1, 'AI6VYNEBK', 'Black', '', '', 'Back Case, Hard Case', 'Apple iPhone 6', 'Apple iPhone 6', '', 'Black', '', '', '', '', '', '', '1', '', 'https://youtu.be/adHwfhoxmq14', 'Vyneer', '', '', 'No Warranty', '', '', '', '', '', '', '', '', '', 'Vyneer 6', '', '', '', '', 0, ''),
