(138, 'iLuv Lay Up Back Case For Apple iPhone 6 Plus - Black', '', 'Keep your iPhone 6 Plus in its beautiful and pristine condition with Layup. This dual-layer case is made from a combination of shock-absorbing silicone and impact-resistant polycarbonate for maximum durability. Head out with your iPhone 6 Plus without worrying about damaging it from scratches, bumps and drops. Layup also has a built-in stand that can be pulled out and used to prop up your phone for comfortable landscape viewing.\n \nRugged Dual-Layer Protection\n \nBuilt with a dual-layer combination of polycarbonate and silicone, Layup is especially rugged. The outer layer is made from soft, shock-absorbing silicone while the inner layer is constructed from hard, impact-resistant polycarbonate. The front of the case is designed with a raised edge that keeps your phone''s screen from touching surfaces even if it is placed or dropped face down. This combination of features provides superior protection against drops, impacts and other accidents.\n \nConverts Into Stand\n \nFor added convenience, Layup converts into a stand so that you can type or watch movies and videos on your iPhone in comfort. Simply pull out the built-in stand and prop up your iPhone to enjoy.\n \nFull Access to Ports and Controls\n \nProtect your iPhone without covering any of its ports or controls. Layup allows you to make full use of your iPhone''s features and functions while keeping it safe. Features:\n-Rugged construction safeguards your iPhone from drops and impacts\n-Dual-layer combination of polycarbonate and silicone for dual protection\n-Front of case features a raised edge that prevents the screen from touching surfaces even when placed face down\n-Built-in stand to prop up phone for comfortable landscape viewing\n-Textured silicone casing prevents dust build up\n-Maintains access to all ports and controls', '', 1, 1399, '', '', NULL, NULL, NULL, '', NULL, '', 1, 1, 'AI6PLAYU', 'Black', '', '', 'Back Case, Tough Case', 'Apple iPhone 6 Plus', 'Apple iPhone 6 Plus', '', 'Black', '', '', '', '', '', '', '1', '', 'https://youtu.be/adHwfhoxmq20', 'Lay Up', '', '', 'No Warranty', '', '', '', '', '', '', '', '', '', 'Lay Up 6 Plus', '', '', '', '', 0, ''),
