(144, 'Incipio Feather Back Case For Apple iPhone 6 - Light Blue', '', 'An Incipio classic, the lightweight feather Case features a high density Plextonium polycarbonate construction and shock absorbing EVA interior liner for added device protection. The sleek, ultra thin case snaps on to the rear of your device for quick installation and adds discreet protection to maintain the slim shape of your device. Express your style in a wide variety of stylish colors! Lightweight and thin design for low-profile protection against bumps and scratches while retaining the slim shape of your new smartphone\nSnap-on application for a quick and user-friendly installation\nFlash-diffusing coated camera ring\nPremium EVA foam inner liner absorbs shock. Measurements:\nLength: 5.54 in (140.716 mm)\nThickness: 0.06 in (1.524 mm)\nWidth: 2.78 in (70.612 mm)\nDepth: 0.38 in (9.652 mm)', '', 1, 2000, '', '', NULL, NULL, NULL, '', NULL, '', 1, 1, 'Iph-1177-Blu', 'Light Blue', '', '', 'Back Case, Hard Case', 'Apple iPhone 6', 'Apple iPhone 6', '', 'Blue', '', '', '', '', '', '', '', '', '', 'Feather', '', '', 'No Warranty', '', '', '', '', '', '', '', '', '', 'Feather 6', '', '', '', '', 0, ''),
