(148, 'Incipio Highland Flip Case For Apple iPhone 6 - White/Grey', '', 'Incipio''s Highland Case is a sophisticated folio with a sturdy, premium rigid textile front cover and a sleek brushed aluminum style finish. The folio''s cover includes an interior slot to store your credit card or ID, and converts into kickstand mode for hands-free media viewing. Whether at the office or traveling on-the-go, the Highland? Case is the perfect blend of premium and lightweight folio protection. Rigid textile cover provides full protection and a refined look and feel\nHard shell snap-on back with a premium brushed aluminum style finish\nHands-free viewing mode for a comfortable media streaming experience\nInterior slot on the cover provides convenient credit card or ID storage. Measurements:\nLength: 5.52 in (140.208 mm)\nThickness: 0.1 in (2.54 mm)\nWidth: 2.8 in (71.12 mm)\nDepth: 0.55 in (13.97 mm)', '', 1, 3250, '', '', NULL, NULL, NULL, '', NULL, '', 1, 1, 'Iph-1183-Whtgry', 'White/Grey', '', '', 'Flip Case', 'Apple iPhone 6', 'Apple iPhone 6', '', 'White', '', '', '', '', '', '', '', '', '', 'Highland', '', '', 'No Warranty', '', '', '', '', '', '', '', '', '', 'Highland 6', '', '', '', '', 0, ''),
(149, 'Incipio Octane Back Case For Apple iPhone 6 - Neon Green', '', 'Incipio''s impact absorbing Octane Case is precision engineered with a rigid Plextonium polycarbonate back shell and a shock absorbent Flex2O TPU textured bumper. Finished with a frosted transparent back and contrasting colorful bumper, the Octane? Case takes protection to the next level. Shock absorbing co-molded design with dual materials for double the protection without the bulk\nImpact resistant Flex2O TPU bumper is flexible for user-friendly installation\nFrosted transparent Plextonium polycarbonate exterior shows off your device while keeping it protected\nShockproof: MIL_STD-810G Method 516.6 Procedure IV, 4ft (Transit Drop) Tested and Passed. Measurements:\nLength: 5.66 in (143.764 mm)\nThickness: 0.07 in (1.778 mm)\nWidth: 2.78 in (70.612 mm)\nDepth: 0.4 in (10.16 mm)', '', 1, 2000, '', '', NULL, NULL, NULL, '', NULL, '', 1, 1, 'Iph-1190-Frstgrn', 'Neon Green', '', '', 'Back Case, Tough Case', 'Apple iPhone 6', 'Apple iPhone 6', '', 'Green', '', '', '', '', '', '', '', '', '', 'Octane', '', '', 'No Warranty', '', '', '', '', '', '', '', '', '', 'Octane 6', '', '', '', '', 0, ''),
