(407, 'B&O Beolit 15 Wireless Portable Speaker - Natural Champange', '', 'Beolit 15 brings you the beauty of its predecessor, in a range of exciting new colours. But the real revolution is inside. Packed with a series of recent innovations - like True360 sound and great new options for connectivity. Beolit 15 applies the latest in Bluetooth technology, the Bluetooth 4.0 supporting the aptX codec. This gives you high quality audio streaming performance, without the need for wifi. Beolit 15 remembers up to 8 users and can have 2 devices connected at a time. At moderate listening levels, Beolit 15 plays up to 24 hours on a single charge.', '', 1, 34990, '', '', '', '0000-00-00', '0000-00-00', '', '', '', 1, 1, '', 'Natural Champange', '5705260047097', '', 'Portable, Bluetooth', 'Bluetooth Enabled Phones, Tablets and Laptops', '', '', 'Gold', '', '', '', '', '', '', 'Beolit 15 speaker including short leather strap, power supply and quick guide', '', 'N_2OmTZ08L0', 'Beolit 15 Wireless', '', 'Approx. 2.7Kgs', '2 Years Warranty', '', '', '', '2 years Manufacturer Warranty from the date of purchase', '', '', '', '', '', 'Beolit 15 Wireless', '', '', 'Without Microphone', '', 0, ''),
