(422, 'Blueair Sense Air Purifier - Polar White', '', 'An air purifier as efficient as it is attractive, the Sense has already been awarded top honors for its cutting-edge technology, sleek design, and environmentally friendly credentials.\n\nThe Sense harnesses future-perfect filters and an ion particle-charging process to remove 99.97% of harmful airborne pollutants from the room faster, with motion-sensor control. Take ease of use to the next level with motion sensor speed control beneath the tempered glass surface. No knobs or buttons. Simply adjust fan speed and on/off with a wave of the hand. Tempered glass with concentric-ring backlit display to indicate fan speed and on/off. The red filter light will illuminate every 6 months when filter needs changing. Once you', '', 1, 39990, '', '', '', '0000-00-00', '0000-00-00', '', '', '', 0, 1, '', 'Polar White', '', '', 'Air Purifier', '', '', '', 'White', '', '', '', '', '', '', '', '', '5MLvdjgcwoI', 'Sense', '', '10 kilograms', '5 Year warranty', '', '', '', 'No warranty on Filters', '', '', '', '', '', 'Sense', '480 x 470 x 170 millimeters', '', '', '', 0, ''),
