(428, 'Blueair 270E Air Purifier - White', '', 'Utilizing an airflow pattern that flows from back to top, the Blueair 270E can occupy tight spaces without compromised performance.\n\nIts small size makes it ideal for placement near a wall or in a corner, just be sure the back of your unit is a minimum of four inches from the wall. Blueair', '', 1, 49990, '', '', '', '0000-00-00', '0000-00-00', '', '', '', 1, 1, '', 'White', '', '', 'Air Purifier', '', '', '', 'White', '', '', '', '', '', '', '', '', '', '270E', '', '11 kilograms', '5 Year warranty', '', '', '', 'No warranty on Filters', '', '', '', '', '', '', '533 x 432 x 241 millimeters', '', '', '', 0, ''),
(429, 'Blueair 450E Air Purifier - Grey', '', 'All the performance with an added digital display.\n\nDesigned for rooms up to 365 square feet, the 450E delivers tried and true efficiency. \n\nSet it to remote control or auto mode to regulate the speed according to the actual amount of particles and gaseous contaminants present in the air. See your indoor air quality status on the digital display any time. Never worry about air quality again.\n\nOur e-series models feature two different kinds of sensors, an optic laser sensor and a ceramic sensor, to sniff out gas and odors and detect high particle counts. When in automatic mode the unit senses when there are pollutants in the air and adjusts the fan speed until they are dissipated. Control your unit from anywhere in the room with the electronic series remote.\n\nEach Blueair e-series unit has two built-in infrared sensors, one on the front door of the unit and one near the electronic display. Fits seamlessly into your home.\n\nAn exceptional paradigm of Swedish design, Blueair purifiers balance high efficiency with high style. Its streamline style has won the 400 Series, the Excellent Swedish Design award, along with a permanent spot in the Design Collection at the Stockholm National Museum. Smiles all around.\n\nHappy to bring you clean air, the electronic display uses friendly faces to rate the air quality of your room. Double the suction, half the noise.\n\nThe 400 series utilizes a double suction radial fan to balance sound frequency, making it lower and more enjoyable. Room Size 34 square meters\nClean Air Delivery Rate 408 cubic meters per hour\nAir changes per hour 5\nAirflow 130 - 475 cubic meters per hour\nHeight x Width x Depth 590 x 500 x 275 millimeters\nProduct weight 15 kilograms\nEnergy consumption 35 - 80 watts\nNoise level 32 - 52 decibels\nElectronic senors, remote, on/off timer Yes\nFilter replacement indicator Yes\n Speed control options  Auto 1 - 2 - 3\n Casters  No - handles\n Air outlet  Side\n Air inlet  Side', '', 1, 74990, '', '', '', '0000-00-00', '0000-00-00', '', '', '', 1, 1, '', 'Grey', '', '', 'Air Purifier', '', '', '', 'Grey', '', '', '', '', '', '', '', '', '', '450E', '', '15 kilograms', '5 Year warranty', '', '', '', 'No warranty on Filters', '', '', '', '', '', '', '590 x 500 x 275 millimeters', '', '', '', 0, ''),
(430, 'Blueair 650E Air Purifier - Grey', '', 'Speed that leaves competition in the dust. \n\nWith its award winning Swedish design, the 650E out performs competitive models with the highest Clean Air Delivery Rate (CADR) in the industry.\n\nCombining the best in electrostatic and mechanical filtration, HEPASilent', '', 1, 94990, '', '', '', '0000-00-00', '0000-00-00', '', '', '', 1, 1, '', 'Grey', '', '', 'Air Purifier', '', '', '', 'Grey', '', '', '', '', '', '', '', '', '', '650E', '', '16 kilograms', '5 Year warranty', '', '', '', 'No warranty on Filters', '', '', '', '', '', '', '660 x 500 x 340 millimeters', '', '', '', 0, ''),
