(486, 'B&O Beosound 8 Dock Speaker - Black', '', 'Superior sound quality due to custom-made conical speakers and four high-performance digital amplifiers. Compact and light design elegance with easy and convenient placement flexibility. Simple user interface and seamless integration. Room adaptation switch for optimum bass performance.', '', 1, 80000, '', '', '', '0000-00-00', '0000-00-00', '', '', '', 1, 1, '', 'Black', '5.70526E+12', '', 'Docks', 'iPhone (3G to 4GS), iPad (2nd, 3rd), iPod Touch (1st to 4th), iPod Nano (2nd to 6th), iPod Classic (2009, 2007)', '', '', 'Black', '', '', '', '', '', '', 'Beosound 8, Remote, 2 x Aluminium Spikes, 2 x Wall Mounts, 2 x Screws, Power Cable, User Manual', '', '5I7v9A9fk_s', 'Beosound 8', '', '', '2 Years Warranty', '', '', '', '2 years Manufacturer Warranty from the date of purchase', '', '', '', '', '', 'Beosound 8', '', '', 'Without Microphone', '', 0, ''),
(487, 'B&O Beoplay A8 Dock Speaker - Black', '', 'BeoPlay A8 is a one-point stereo system with truly powerful acoustics. It is simple and intuitive to use, it works with all devices and we like to think it brings new life to both your digital music and your home. You will perhaps notice that the cabinet is polished horizontally, while the control wheel is polished circularly, so that light is reflected differently on the stereo system enhancing the craftsmanship and attention to detail. Whether it is an Apple iPhone, iPad or iPod, an Android phone or tablet or even a laptop you are playing your music from, it will go hand in hand with the A8. There is also an exchangeable dock that lets you place your mobile phone or tablet elegantly atop of the stereo system. This way you will have a cool, central resting place for your device and it will even be charged while playing out your music.', '', 1, 124900, '', '100000', '', '0000-00-00', '0000-00-00', '', '', '', 1, 1, '', 'Black', '5.70526E+12', '', 'Airplay, Docks', 'Lightining connector for new iPhone, iPad, iPod and 30 Pin coonector for iPhone (3G to 4GS), iPad (2nd, 3rd), iPod Touch (1st to 4th), iPod Nano (2nd to 6th), iPod Classic. Airplay for Apple devices and DLNA for Android Devices (Wireless).  Line-in (Wired', '', '', 'Black', '', '', '', '', '', '', 'BeoPlay A8, 2 x Aluminium Spikes, Lightning Connector Dock, Power Cable, User Manual', '', 'xs4Zqgx0Uw8', 'Beoplay A8', '', 'Approx. 4.25 kg', '2 Years Warranty', '', '', '', '2 years Manufacturer Warranty from the date of purchase', '', '', '', '', '', 'Beoplay A8', '', '', 'Without Microphone', '', 0, ''),
(488, 'B&O Beoplay A8 Dock Speaker - White', '', 'BeoPlay A8 is a one-point stereo system with truly powerful acoustics. It is simple and intuitive to use, it works with all devices and we like to think it brings new life to both your digital music and your home. You will perhaps notice that the cabinet is polished horizontally, while the control wheel is polished circularly, so that light is reflected differently on the stereo system enhancing the craftsmanship and attention to detail. Whether it is an Apple iPhone, iPad or iPod, an Android phone or tablet or even a laptop you are playing your music from, it will go hand in hand with the A8. There is also an exchangeable dock that lets you place your mobile phone or tablet elegantly atop of the stereo system. This way you will have a cool, central resting place for your device and it will even be charged while playing out your music.', '', 1, 124900, '', '100000', '', '0000-00-00', '0000-00-00', '', '', '', 1, 1, '', 'White', '', '', 'Airplay, Docks', 'Lightining connector for new iPhone, iPad, iPod and 30 Pin coonector for iPhone (3G to 4GS), iPad (2nd, 3rd), iPod Touch (1st to 4th), iPod Nano (2nd to 6th), iPod Classic. Airplay for Apple devices and DLNA for Android Devices (Wireless).  Line-in (Wired', '', '', 'White', '', '', '', '', '', '', 'BeoPlay A8, 2 x Aluminium Spikes, Lightning Connector Dock, Power Cable, User Manual', '', 'xs4Zqgx0Uw8', 'Beoplay A8', '', 'Approx. 4.25 kg', '2 Years Warranty', '', '', '', '2 years Manufacturer Warranty from the date of purchase', '', '', '', '', '', 'Beoplay A8', '', '', 'Without Microphone', '', 0, ''),
(489, 'B&O Beoplay A9 Airplay Speaker - Black', '', 'Updating a modern classic with an innovative user interface and integration of more digital services, Iconic in shape, elegant in appearance and gorgeous in sound, BeoPlay A9 is a one-point music system capable of handling all of your music needs. With the A9 all you need is a digital music source and the music system will take care of the rest - and make beautiful sounds flow through your home with ease. Stream wirelessly via AirPlay or DLNA. Intuitive touch control. Future proof with automatic software updates.', '', 1, 200000, '', '', '', '0000-00-00', '0000-00-00', '', '', '', 1, 1, '', 'Black', '', '', 'Airplay', 'Airplay for Apple devices and DLNA for Android Devices (Wireless) and Line-in (Wired).', '', '', 'Black', '', '', '', '', '', '', 'BeoPlay A9 Black with walnut legs (Black Base & Black Cover), Power Cable, User Manual', '', 'U0FCzcaMerA', 'Beoplay A9', '', 'Approx. 15 kg (incl. legs), 14.2 kg (without legs)', '2 Years Warranty', '', '', '', '2 years Manufacturer Warranty from the date of purchase', '', '', '', '', '', 'Beoplay A9', '', '', 'Without Microphone', '', 0, ''),
