(491, 'B&O Beoplay S8 Speaker - Black', '', 'Meet the new S8 from B&O PLAY. We have combined award winning design with powerful acoustic performance to shape a speaker that instantly enhances any home audio setup. Connect to any streaming device or audio source and bring some serious sound to your listening experiences. The S8 setup offers a variety of placement options, making it flexible enough to fit any home. Two satellite speakers can be hung on the wall or positioned with table stands, while the subwoofer has been specifically designed to sound amazing no matter where you choose to put it.', '', 1, 135000, '', '', '', '0000-00-00', '0000-00-00', '', '', '', 1, 1, '', 'Black', '', '', 'Others', 'Connect to an audio source via volume regulated audio output using RCA plugs or 3.5mm jack.', '', '', 'Black', '', '', '', '', '', '', '2 x Satellite Speaker, 1 x Subwoofer, Power Cable, User Manual', '', '', 'Beoplay S8', '', 'Approx. Satellite Speaker 0.8 kg each, Subwoofer 10.5 kg', '2 Years Warranty', '', '', '', '2 years Manufacturer Warranty from the date of purchase', '', '', '', '', '', 'Beoplay S8', '', '', 'Without Microphone', '', 0, ''),
