(525, 'GoPro Hero 4 Black Action Camera', '', 'HERO4 Black takes Emmy Award-winning GoPro performance to the next level with our best image quality yet, plus a 2x more powerful processor that delivers super slow motion at 240 frames per second. Incredible high-resolution 4K30 and 2.7K60 video combines with 1080p120 and 720p240 slow motion to enable stunning, immersive footage of you and your world. Protune settings for both photos and video unlock manual control of Color, ISO Limit, Exposure and more. Waterproof (40m) with 12MP photos at 30 frames per second and improved audio, HERO4 Black is the ultimate life-capture solution for those who demand the best. No Built-in Memory, Supports Upto 64GB (Class 10, UHS - 1 rated Micro-SD Memory Card Required)', '', 1, 43990, '', '', '', '0000-00-00', '0000-00-00', '', '', '', 1, 1, 'CHDHX401EU', 'Hero 4 Black', '8.18279E+11', '', '', 'Go Pro App Available in Apple Store, Play Store, Windows Market', '', '', '', '', '', '', '', '', '', 'HERO4 Black Camera, Standard Housing (40m Waterproof), Skeleton Backdoor, Rechargeable Battery, Curved Adhesive Mount, Flat Adhesive Mount, Quick Release Buckles, 3-Way Pivot Arm (Mounting Hardware), USB Cable and User Manual', '', '_rcDPF14sr0', 'Hero 4 Black', '', 'Camera (89 Gms), With Housing (152 Gms)', '1 Year Warranty', '', '', '', '1 year Manufacturer Warranty from the date of purchase. No warranty on burnt/physical damage/damage due to water.', '', '', '', '', '', 'GoPro Cameras', '', '', '', '', 0, ''),
(526, 'GoPro Hero 4 Silver Action Camera', '', 'Capture your world with HERO4 Silver, the high-performance GoPro with a built-in touch display. Controlling the camera, framing shots and playing back content is now ultra convenient-just view, tap and swipe the screen. HERO4 Silver captures 1080p60 and 720p120 video with lifelike clarity, plus 12MP photos at a staggering 30 frames per second. Built-in video trimming lets you create and save short highlight clips for easy sharing. HiLight Tag enables you to mark key moments to make them easier to find later. Waterproof (40m), HERO4 Silver combines versatility and high-performance capture with the convenience of a touch display. No Built-in Memory, Supports Upto 64GB (Class 10, UHS - 1 rated Micro-SD Memory Card Required)', '', 1, 34990, '', '', '', '0000-00-00', '0000-00-00', '', '', '', 5, 1, 'CHDHY401EU', 'Hero 4 Silver', '8.18279E+11', '', '', 'Go Pro App Available in Apple Store, Play Store, Windows Market', '', '', '', '', '', '', '', '', '', 'HERO4 Silver Camera with Built-In Touch Display, Standard Housing (40m Waterproof), Skeleton + Touch Backdoors, Rechargeable Battery, Curved Adhesive Mount, Flat Adhesive Mount, Quick Release Buckles, 3-Way Pivot Arm (Mounting Hardware), USB Cable and Use', '', 'BKM9jAqJZoY', 'Hero 4 Silver', '', 'Camera (84 Gms), With Housing (147 Gms)', '1 Year Warranty', '', '', '', '1 year Manufacturer Warranty from the date of purchase. No warranty on burnt/physical damage/damage due to water.', '', '', '', '', '', 'GoPro Cameras', '', '', '', '', 0, ''),
(527, 'GoPro Hero 4 Session Action Camera', '', '50% smaller and 40% lighter than other HERO4 cameras, HERO4 Session is the most wearable and mountable GoPro ever. With a sleek, versatile design, it is at home anywhere-from the surf to the snow to hanging with friends. HERO4 Session delivers stunning video quality. Capture high-resolution 1440p30 and 1080p60 video that’s sharp and lifelike. High frame rate 720p100 video enables exceptionally smooth slow-motion playback of your best moments. Nail the shot with a variety of photo modes. Capture 8MP single photos, Time Lapse photos at set intervals from 0.5 to 60 seconds, and Burst photos at 10 frames per second. When it comes to versatile photo capture, HERO4 Session’s got you covered. HERO4 Session is a rugged and waterproof camera that you can take down to 10m without a separate housing. Its convenient, ready-to-go design makes it easy to get out the door quickly to capture and enjoy your session. No Built-in Memory, Supports Upto 64GB (Class 10, UHS - 1 rated Micro-SD Memory Card Required)', '', 1, 19990, '', '', '', '0000-00-00', '0000-00-00', '', '', '', 1, 1, 'CHDHS101EU', 'Hero 4 Session', '8.18279E+11', '', '', 'Go Pro App Available in Apple Store, Play Store, Windows Market', '', '', '', '', '', '', '', '', '', 'HERO4 Session Camera (10m Waterproof), Standard Frame, Low-Profile Frame, Curved Adhesive Mount, Flat Adhesive Mount, Ball Joint Buckle, Mounting Buckles + Hardware, Micro-USB Cable and User Manual', '', 'krKORWPpwLk', 'Hero 4 Session', '', 'Camera (74 Gms)', '1 Year Warranty', '', '', '', '1 year Manufacturer Warranty from the date of purchase. No warranty on burnt/physical damage/damage due to water.', '', '', '', '', '', 'GoPro Cameras', '', '', '', '', 0, ''),
(528, 'GoPro Hero + LCD Action Camera', '', 'Capture incredible moments and relive them on the spot. HERO+ LCD delivers 1080p60 video and 8MP photos, and features the convenience of a touch display. Built-in Wi-Fi and Bluetooth connect to the GoPro App to allow for shot preview, total camera control and easy content sharing to Instagram, Facebook, Twitter and more from your phone or tablet. Rugged and waterproof to 40m, with the ability to power up and record at the press of a button, HERO+ LCD is the convenient life capture solution for all of your adventures. No Built-in Memory, Supports Upto 64GB (Class 10, UHS - 1 rated Micro-SD Memory Card Required)', '', 1, 25990, '', '', '', '0000-00-00', '0000-00-00', '', '', '', 2, 1, 'CHDHB101EU', 'Hero + LCD', '8.18279E+11', '', '', 'Go Pro App Available in Apple Store, Play Store, Windows Market', '', '', '', '', '', '', '', '', '', 'HERO+ LCD Camera with Built-In Touch Display and Integrated Housing (40m Waterproof), Built-In Battery, Skeleton Backdoor, Touch Backdoor, Curved Adhesive Mount, Flat Adhesive Mount, Mounting Buckle, Micro USB Cable and User Manual', '', 'IjszDEByTgo', 'Hero + LCD', '', 'Camera with integrated housing (127 Gms)', '1 Year Warranty', '', '', '', '1 year Manufacturer Warranty from the date of purchase. No warranty on burnt/physical damage/damage due to water.', '', '', '', '', '', 'GoPro Cameras', '', '', '', '', 0, ''),
(529, 'GoPro Hero + Action Camera', '', 'HERO+ captures immersive 1080p60 video and 8MP photos and features Wi-Fi and Bluetooth, which provide access to the GoPro App and Smart Remote. The GoPro App lets you control your camera remotely, preview your shots, play back content and create short highlight clips on your phone or tablet for easy sharing to Instagram, Facebook, YouTube and more. Waterproof to 40m and packed with user-friendly camera modes, HERO+ is the entry-level GoPro for those who want high-quality capture and on-the-go connectivity. No Built-in Memory, Supports Upto 64GB (Class 10, UHS - 1 rated Micro-SD Memory Card Required)', '', 1, 18990, '', '', '', '0000-00-00', '0000-00-00', '', '', '', 2, 1, 'CHDHC101EU', 'Hero +', '8.18279E+11', '', '', 'Go Pro App Available in Apple Store, Play Store, Windows Market', '', '', '', '', '', '', '', '', '', 'HERO+ Camera with Integrated Housing (40m Waterproof), Built-In Battery, Skeleton Backdoor, Curved Adhesive Mount, Flat Adhesive Mount, Quick Release Buckle, USB Cable and User Manual', '', 'GZum5RYGVi0', 'Hero +', '', 'Camera with integrated housing (123 Gms)', '1 Year Warranty', '', '', '', '1 year Manufacturer Warranty from the date of purchase. No warranty on burnt/physical damage/damage due to water.', '', '', '', '', '', 'GoPro Cameras', '', '', '', '', 0, ''),
(530, 'GoPro Hero Action Camera', '', 'HERO makes it easy to capture and share your world. Featuring high-quality 1080p30 and 720p60 video, HERO captures the same immersive footage that is made GoPro one of the best-selling cameras in the world. User-friendly modes include QuikCapture, which lets you power on the camera and start recording with the press of a single button, and Burst Photo, which captures fast-action sequences at up to 5 frames per second. Wearable, gear-mountable and integrated into a rugged housing that is waterproof to 40m, HERO helps you capture photos and videos that make you look like just a HERO. No Built-in Memory, Supports Upto 32GB (Class 10, UHS - 1 rated Micro-SD Memory Card Required)', '', 1, 12400, '', '', '', '0000-00-00', '0000-00-00', '', '', '', 5, 1, 'CHDHA301EU', 'Hero', '8.18279E+11', '', '', '', '', '', '', '', '', '', '', '', '', 'Hero Integrated Camera + Housing (40m Waterproof), Built-In Battery, Skeleton Backdoor, Curved Adhesive Mount, Flat Adhesive Mount, Quick Release Buckle, USB Cable and User Manual', '', '', 'Hero', '', 'Camera with integrated housing (111 Gms)', '1 Year Warranty', '', '', '', '1 year Manufacturer Warranty from the date of purchase. No warranty on burnt/physical damage/damage due to water.', '', '', '', '', '', 'GoPro Cameras', '', '', '', '', 0, ''),
(531, 'GoPro 3 Way', '', 'Configurable for a wide range of uses, from capturing POV footage and selfies, to follow-cam, static tripod shots and more\nFolding arm makes it easy to capture selfies without the mount appearing in the shot\nUse the arm plus grip like a pole mount for immersive POV or follow-cam footage\nHandle can be detached from the arm and used as a camera grip\nRemovable tripod conveniently stores inside the handle\nLightweight, mini tripod can be used on its own or combined with the handle\nWaterproof construction for use in and out of the water\nMeasures 20&#34; (50.8cm) when fully extended, collapses to 7.5&#34; (19cm)', '', 1, 5990, '', '', NULL, NULL, NULL, 'Gopro 3 Way', NULL, 'Access - Gopro 3 Way,Gopro 3 Way,Gopro ,Gopro India,Gopro Access,Gopro Mumbai,Gopro  Mumbai,Gopro Cameras Mumbai,Gopro Cameras India,Gopro Accessories Mumbai,Gopro Accessories India,Gopro Mounts Mumbai,Gopro Mounts India', 1, 1, 'AFAEM-001', '3 Way', '818279010954', '', 'Mounts', 'All GoPro cameras', '', '', '', '', '', '', '', '', '', 'Extension Arm\nGrip\nTripod\nThumb Screw', '', '2ZUCq3CNJNY', '3 Way', '', '', 'No  Warranty', '', '', '', '', '', '', '', '', '', 'Gopro Mounts', '', '', '', '', 0, '12.5'),
(532, 'GoPro Smart Remote', '', 'Control your GoPro remotely from distances of up to 600&#39; (180m) with this wearable, waterproof remote. Perfect for gear-mounted shots, you can power the camera on/off, adjust settings, start/stop recording and capture photos. When used with HERO4 cameras, you can also access the Settings/Tag button to quickly change settings, or use HiLight Tag to mark key moments while recording for easy playback, editing and sharing. Smart Remote enables control of up to 50 cameras at a time, and features 40% increased battery capacity compared to the Wi-Fi Remote. Mountable and waterproof to 33&#39; (10m). Includes a key ring and wrist strap for wearing the remote or attaching it to your gear.\nDelivers full remote control of all camera functions, including shutter, on/off and settings\nSettings/Tag button allows you to quickly adjust settings or mark key moments while recording with HiLight Tag (HERO4 cameras only)\nUp to 600&#39; (180m) range in optimal conditions\nEnables control of up to 50 cameras at a time\nRugged design is wearable, mountable and waterproof to 33&#39; (10m)\n40% increased battery capacity compared to the Wi-Fi Remote\nBuilt-in LCD mirrors your camera&#39;s status screen for quick confirmation of camera functions and settings\nIncludes a key ring and wrist strap for wearing the remote or attaching it to gear', '', 1, 7960, '', '', NULL, NULL, NULL, 'Gopro Smart Remote', NULL, 'Access - Gopro Smart Remote,Gopro Smart Remote,Gopro ,Gopro India,Gopro Access,Gopro Mumbai,Gopro  Mumbai,Gopro Cameras Mumbai,Gopro Cameras India,Gopro Accessories Mumbai,Gopro Accessories India,Gopro Mounts Mumbai,Gopro Mounts India', 1, 1, 'ARMTE-002', 'Smart Remote', '818279012033', '', 'Accessories', ' HERO4 Black, HERO4 Silver, HERO4 Session, HERO3+, HERO3, HERO+ LCD, HERO+', '', '', '', '', '', '', '', '', '', 'Smart Remote\nAttachment Key + Ring\nWrist Strap\nUSB Charging Cable', '', '', 'Smart Remote', '', '', '1 Year Warranty', '', '', '', 'No Warranty on Physical Damage', '', '', '', '', '', 'Gopro accessories', '', '', '', '', 0, '12.5'),
(533, 'GoPro Head Strap & QuickClip', '', 'Includes a Head Strap and a QuickClip for a variety of head-mounting options. Fully adjustable to fit all sizes, the Head Strap can be worn over a helmet or directly on your head to capture footage from a headlamp-like perspective. The QuickClip enables ultra compact, low-profile mounting, and can be used to attach your GoPro to a backwards baseball cap or other 3mm to 10mm thick object.\nHead Strap is fully adjustable to fit all sizes\nHead Strap can be worn over a helmet or directly on your head in a headlamp-like position\nQuickClip allows you to attach your GoPro to a backwards baseball cap or other 3mm to 10mm thick object\nQuickClip enables ultra compact, low-profile mounting\nWarranty: 1 Year', '', 1, 1525, '', '', NULL, NULL, NULL, 'Gopro Head Strap & QuickClip', NULL, 'Access - Gopro Head Strap & QuickClip,Gopro Head Strap & QuickClip,Gopro ,Gopro India,Gopro Access,Gopro Mumbai,Gopro  Mumbai,Gopro Cameras Mumbai,Gopro Cameras India,Gopro Accessories Mumbai,Gopro Accessories India,Gopro Mounts Mumbai,Gopro Mounts India', 1, 1, 'ACHOM-001', 'Head Strap', '', '', 'Mounts', 'All GoPro cameras', '', '', '', '', '', '', '', '', '', 'Head Strap\nQuickClip\nThumb Screw', '', '', 'Head Strap & QuickClip', '', '', 'No  Warranty', '', '', '', '', '', '', '', '', '', 'Gopro Mounts', '', '', '', '', 0, '12.5'),
(534, 'GoPro Chesty', '', 'The Chesty makes it easy to capture immersive video and photos from, well ', '', 1, 2860, '', '', NULL, NULL, NULL, 'Gopro Chesty', NULL, 'Access - Gopro Chesty,Gopro Chesty,Gopro ,Gopro India,Gopro Access,Gopro Mumbai,Gopro  Mumbai,Gopro Cameras Mumbai,Gopro Cameras India,Gopro Accessories Mumbai,Gopro Accessories India,Gopro Mounts Mumbai,Gopro Mounts India', 1, 1, 'GCHM30-001', 'Chesty', '185323000989', '', 'Mounts', 'All GoPro cameras', '', '', '', '', '', '', '', '', '', 'Chesty (Chest Harness)\nVertical Quick Release Buckle\nThumb Screw', '', '', 'Chesty', '', '', 'No  Warranty', '', '', '', '', '', '', '', '', '', 'Gopro Mounts', '', '', '', '', 0, '12.5'),
(535, 'GoPro The Handler', '', 'Get a solid grip on your GoPro and keep it afloat with The Handler. Whether capturing selfies, POV or follow-cam footage, this buoyant hand grip delivers increased stability and control&#9472;making it easy to aim the camera and frame your shots with confidence. Perfect for surfing, kayaking, wakeboarding and more, it floats any GoPro camera plus BacPac&#8482; accessory so you can shoot in and around the water without a worry. Includes an adjustable wrist strap and The Tool&#9472;a GoPro thumb screw wrench that doubles as a bottle opener. Waterproof to 33&#39; (10m).\nKeeps your GoPro afloat so you can shoot in and around the water worry-free\nEnables more stable footage than holding the camera by hand\nMakes it easy to aim your camera and capture a variety of angles\nComfortable, non-slip construction for a secure grip\nPerfect for surfing, kayaking, wakeboarding and other water sports\nFloats any GoPro camera plus LCD Touch BacPac&#8482; or Battery BacPac&#8482;\nIncludes an adjustable wrist strap for greater security of your camera\nIncludes The Tool, a GoPro thumb screw wrench that doubles as a bottle opener\nWaterproof to 33&#39; (10m)', '', 1, 2235, '', '', NULL, NULL, NULL, 'Gopro The Handler', NULL, 'Access - Gopro The Handler,Gopro The Handler,Gopro ,Gopro India,Gopro Access,Gopro Mumbai,Gopro  Mumbai,Gopro Cameras Mumbai,Gopro Cameras India,Gopro Accessories Mumbai,Gopro Accessories India,Gopro Mounts Mumbai,Gopro Mounts India', 1, 1, 'AFHGM-001', 'The Handler', '818279012576', '', 'Mounts', 'All GoPro cameras', '', '', '', '', '', '', '', '', '', 'The Handler (Floating Hand Grip)\nMounting Hardware\nWrist Strap\nThe Tool', '', '', 'The Handler', '', '', 'No  Warranty', '', '', '', '', '', '', '', '', '', 'Gopro Mounts', '', '', '', '', 0, '12.5'),
(536, 'GoPro Rechargeable Battery', '', 'Use this 1160mAh lithium-ion rechargeable battery as a spare or replacement for your HERO4 Black or HERO4 Silver camera.\n1160mAh lithium-ion rechargeable battery\nUse as a spare or replacement battery for your HERO4 Black or HERO4 Silver camera', '', 1, 2135, '', '', NULL, NULL, NULL, 'Gopro Rechargeable Battery', NULL, 'Access - Gopro Rechargeable Battery,Gopro Rechargeable Battery,Gopro ,Gopro India,Gopro Access,Gopro Mumbai,Gopro  Mumbai,Gopro Cameras Mumbai,Gopro Cameras India,Gopro Accessories Mumbai,Gopro Accessories India,Gopro Mounts Mumbai,Gopro Mounts India', 1, 1, 'AHDBT-401', 'Rechargeable Battery', '818279011654', '', 'Accessories', 'Hero 4 Black, Hero 4 Silver', '', '', '', '', '', '', '', '', '', 'Rechargeable Battery (for HERO4 Black/HERO4 Silver)', '', '', 'Rechargeable Battery', '', '', '1 Year Warranty', '', '', '', 'No Warranty on Physical Damage', '', '', '', '', '', 'Gopro accessories', '', '', '', '', 0, '12.5'),
(537, 'GoPro Suction Cup', '', 'Attach your GoPro to cars, boats, motorcycles and more. This industrial-strength Suction Cup mount is proven at speeds of 150+ mph and engineered for stability and a broad range of motion. Adjustable arms allow for ultra compact mounting. Includes a standard base and a quick release base for moving conveniently between shots and locations. For maximum holding strength, attach to a clean surface.\nAttach your GoPro to cars, boats, motorcycles and more\nIndustrial-strength suction cup proven at speeds of 150+ mph\nEngineered to provide a broad range of motion and stability\nQuick release base makes moving between shots and locations quick and convenient\nWarranty: One year\n\nNote: Not recommended for surfing, snowboarding or other high-impact sports. Recommended for non-impact activities only. The Floaty Backdoor will not support the weight of the Suction Cup mount.', '', 1, 2860, '', '', NULL, NULL, NULL, 'Gopro Suction Cup', NULL, 'Access - Gopro Suction Cup,Gopro Suction Cup,Gopro ,Gopro India,Gopro Access,Gopro Mumbai,Gopro  Mumbai,Gopro Cameras Mumbai,Gopro Cameras India,Gopro Accessories Mumbai,Gopro Accessories India,Gopro Mounts Mumbai,Gopro Mounts India', 1, 1, 'AUCMT-302', 'Suction Cup', '818279010695', '', 'Mounts', 'All GoPro cameras', '', '', '', '', '', '', '', '', '', 'Suction Cup\nAdjustable Arms\nStandard Base\nQuick Release Base\nDrawstring Bag', '', 'A5-It8Bjv5U', 'Suction Cup', '', '', 'No  Warranty', '', '', '', '', '', '', '', '', '', 'Gopro Mounts', '', '', '', '', 0, '12.5'),
(538, 'GoPro Handlebar Seatpost Pole Mount', '', 'Mount your GoPro to handlebars, seatposts, ski poles, kitesurfing control bars and more. You can also clamp this mount to chainstays, small-diameter roll bars and bolt heads, or secure it to a pipe or pole to create a handheld boom. Fits 0.75&#34; to 1.4&#34; (19.5mm to 35.56mm) diameter tubes, plus smaller 0.43&#34; to 0.7&#34; (11mm to 18mm) diameter tubes with the included adapter. The included 3-Way Pivot Arm offers 3-way adjustability to help achieve the perfect angle for every shot.\nPerfect for bicycle seatposts and handlebars, ski poles and more\nFits 0.75&#34; to 1.4&#34; (19.5mm to 35.56mm) diameter tubes\nFits smaller .43&#34; to 0.7&#34; (11mm to 18mm) diameter tubes with included adapter\nCan be clamped to a pipe or pole to create a handheld boom\n3-Way Pivot Arm allows for easy aiming\nProtective liner prevents marring on mounting surface and enhances stability', '', 1, 1525, '', '', NULL, NULL, NULL, 'Gopro Handlebar Seatpost Pole Mount', NULL, 'Access - Gopro Handlebar Seatpost Pole Mount,Gopro Handlebar Seatpost Pole Mount,Gopro ,Gopro India,Gopro Access,Gopro Mumbai,Gopro  Mumbai,Gopro Cameras Mumbai,Gopro Cameras India,Gopro Accessories Mumbai,Gopro Accessories India,Gopro Mounts Mumbai,Gopro', 1, 1, 'GRH30', 'Handlebar', '185323000064', '', 'Mounts', 'All GoPro cameras', '', '', '', '', '', '', '', '', '', 'Handlebar / Seatpost / Pole Mount\n3-Way Pivot Arm (Mounting Hardware)\nThumb Screw\nAdapter\nProtective Liner', '', 'GoSCu5gO7rQ', 'Handlebar Seatpost Pole Mount', '', '', 'No  Warranty', '', '', '', '', '', '', '', '', '', 'Gopro Mounts', '', '', '', '', 0, '12.5'),
(539, 'GoPro Tripod Mounts', '', 'Easily attach your GoPro to any standard tripod using the Tripod Mount or the Quick Release Tripod Mount. Also includes a lightweight Mini Tripod that attaches directly to your GoPro&#39;s frame or housing. All three provide a solid platform for any situation where stability is a must.\nEasily attach your GoPro to any standard tripod\nIncludes Tripod Mount plus a Quick Release Tripod Mount to move conveniently between shots and locations\nAlso includes a lightweight Mini Tripod that attaches to your GoPro&#39;s frame or housing', '', 1, 720, '', '', NULL, NULL, NULL, 'Gopro Tripod Mounts', NULL, 'Access - Gopro Tripod Mounts,Gopro Tripod Mounts,Gopro ,Gopro India,Gopro Access,Gopro Mumbai,Gopro  Mumbai,Gopro Cameras Mumbai,Gopro Cameras India,Gopro Accessories Mumbai,Gopro Accessories India,Gopro Mounts Mumbai,Gopro Mounts India', 1, 1, 'ABQRT-002', 'Tripod Mounts', '81827901068', '', 'Mounts', 'All GoPro cameras', '', '', '', '', '', '', '', '', '', 'Tripod Mount\nQuick Release Tripod Mount\nMini Tripod', '', '', 'Tripod Mounts', '', '', 'No  Warranty', '', '', '', '', '', '', '', '', '', 'Gopro Mounts', '', '', '', '', 0, '12.5'),
(540, 'GoPro LCD Touch BacPac', '', 'The LCD Touch BacPac&#8482; is a removable touch display that seamlessly attaches to the back of your GoPro for added convenience and control. It&#39;s perfect for playing back videos and photos directly from your camera, including audio and instant slow-motion playback. See what your camera sees to frame your shots with confidence. Adjusting camera settings is easier than ever&#9472;just tap and touch the screen. Plus, when used with HERO4 cameras, you can select modes and navigate menus with a simple swipe. Includes Standard, Skeleton and Touch BacPac&#8482; Backdoors.\nSeamlessly attaches to the back of your GoPro\nPlay back videos and photos, including audio and instant slow-motion playback\nSee what your camera sees to frame your shots with confidence\nDelivers convenient touch control of all camera settings\nFeatures a built-in speaker with volume control and a 3.5mm headphone jack\nBrightness can be adjusted to customize viewing and conserve battery life\nCompact design keeps your GoPro as small and light as possible\nCompatible for use with your Standard Housing, Skeleton Housing and Blackout Housing with the included BacPac&#8482; Backdoors', '', 1, 7665, '', '', NULL, NULL, NULL, 'Gopro LCD Touch BacPac', NULL, 'Access - Gopro LCD Touch BacPac,Gopro LCD Touch BacPac,Gopro ,Gopro India,Gopro Access,Gopro Mumbai,Gopro  Mumbai,Gopro Cameras Mumbai,Gopro Cameras India,Gopro Accessories Mumbai,Gopro Accessories India,Gopro Mounts Mumbai,Gopro Mounts India', 1, 1, 'ALCDB-401', 'LCD Touch BacPac', '818279012538', '', 'Accessories', 'HERO4 Black, HERO3+, HERO3', '', '', '', '', '', '', '', '', '', 'LCD Touch BacPac&#8482;\nStandard BacPac Backdoor\nSkeleton BacPac Backdoor\nTouch BacPac Backdoor\nMounting Hardware\nProtective Case', '', '', 'LCD Touch BacPac', '', '', '1 Year Warranty', '', '', '', 'No Warranty on Physical Damage', '', '', '', '', '', 'Gopro accessories', '', '', '', '', 0, '12.5'),
(541, 'GoPro Jaws Flex Clamp', '', 'Clamp your GoPro to objects ranging in size from 0.25&#34; to 2&#34; (0.6cm to 5cm) in diameter. Attach your camera directly to the clamp for low-profile mounting, or use the optional neck to achieve a wider range of camera-angle adjustability. Jaws securely grips irregular shapes and super slim objects thanks to its innovative design.\nClamp your GoPro to objects ranging in size from 0.25&#34; to 2&#34; (0.6cm to 5cm) in diameter\nOptional neck adjusts to enable a variety of shooting angles\nCamera can be attached directly to clamp for low-profile mounting\nQuick release bases make it easy to move camera between different mounts and locations', '', 1, 3580, '', '', NULL, NULL, NULL, 'Gopro Jaws Flex Clamp', NULL, 'Access - Gopro Jaws Flex Clamp,Gopro Jaws Flex Clamp,Gopro ,Gopro India,Gopro Access,Gopro Mumbai,Gopro  Mumbai,Gopro Cameras Mumbai,Gopro Cameras India,Gopro Accessories Mumbai,Gopro Accessories India,Gopro Mounts Mumbai,Gopro Mounts India', 1, 1, 'ACMPM-001', 'Jaws Flex Clamp', '818279010732', '', 'Mounts', 'All GoPro cameras', '', '', '', '', '', '', '', '', '', 'Jaws: Flex Clamp\nAdjustable Neck', '', 'IENyZxA9pok', 'Jaws Flex Clamp', '', '', 'No  Warranty', '', '', '', '', '', '', '', '', '', 'Gopro Mounts', '', '', '', '', 0, '12.5'),
(542, 'GoPro Curved & Flat Adhesive Mounts', '', 'Easily attach your GoPro to curved and flat surfaces with these industrial-strength waterproof adhesive mounts. Can be removed by heating adhesive bond with a hair dryer then peeling off mount.\nCompatible with a wide variety of curved and flat surfaces\nIndustrial-strength adhesive ensures secure mounting\nRemovable by applying heat to adhesive bond and peeling off mount\n \nNote: Always select a helmet that meets the applicable safety standard when you use with a GoPro helmet mount. Always follow the helmet manufacturer&#39;s instructions on safe helmet use.', '', 1, 1525, '', '', NULL, NULL, NULL, 'Gopro Curved & Flat Adhesive Mounts', NULL, 'Access - Gopro Curved & Flat Adhesive Mounts,Gopro Curved & Flat Adhesive Mounts,Gopro ,Gopro India,Gopro Access,Gopro Mumbai,Gopro  Mumbai,Gopro Cameras Mumbai,Gopro Cameras India,Gopro Accessories Mumbai,Gopro Accessories India,Gopro Mounts Mumbai,Gopro', 1, 1, 'AACFT-001', 'Adhesive Mounts', '818279010312', '', 'Mounts', 'All GoPro cameras', '', '', '', '', '', '', '', '', '', '3 Curved Adhesive Mounts\n3 Flat Adhesive Mounts', '', 'uzSF3AnIHQo', 'Curved & Flat Adhesive Mounts', '', '', 'No  Warranty', '', '', '', '', '', '', '', '', '', 'Gopro Mounts', '', '', '', '', 0, '12.5'),
(543, 'GoPro Helmet Front Mount', '', 'Mount your GoPro to the front of your helmet in a headlamp-like position. Capture forward-facing footage, or adjust the extendable arm so the camera is facing back at you for self-portrait videos and photos. The mount can be removed by heating the adhesive bond with a hair dryer then peeling off mount.\nMounts to the front of most helmets\nCapture forward-facing footage or self-portrait photos and videos\nCan be removed by applying heat to adhesive bond\nWarranty: 1 Year\n \nNote: Always select a helmet that meets the applicable safety standard when you use with a GoPro helmet mount. Always follow the helmet manufacturer&#39;s instructions on safe helmet use.', '', 1, 1160, '', '', NULL, NULL, NULL, 'Gopro Helmet Front Mount', NULL, 'Access - Gopro Helmet Front Mount,Gopro Helmet Front Mount,Gopro ,Gopro India,Gopro Access,Gopro Mumbai,Gopro  Mumbai,Gopro Cameras Mumbai,Gopro Cameras India,Gopro Accessories Mumbai,Gopro Accessories India,Gopro Mounts Mumbai,Gopro Mounts India', 1, 1, 'AHFMT-001', 'Helmet Front Mount', '185323000361', '', 'Mounts', 'All GoPro cameras', '', '', '', '', '', '', '', '', '', 'Curved Adhesive Mount\nVertical Quick Release Buckle\n2 Extension Arms\nThumb Screws', '', '', 'Helmet Front Mount', '', '', 'No  Warranty', '', '', '', '', '', '', '', '', '', 'Gopro Mounts', '', '', '', '', 0, '12.5'),
(544, 'GoPro The Frame', '', 'The Frame is the smallest, lightest way to mount your GoPro, and enables ultra compact, low-profile mounting. The open design delivers optimal audio capture during low-speed activities, plus access to the camera&#39;s microSD, Micro HDMI and USB ports for easy data offload, live-feed video and charging. An extendable support arm allows you to conveniently attach an LCD Touch BacPac&#8482; or Battery BacPac&#8482; (sold separately), and holds the BacPac&#8482; securely in place while shooting.1 The integrated latch makes removing your GoPro from The Frame quick and easy. Includes a glass Protective Lens to help guard the camera lens from scratches, dirt and debris.\nSmallest, lightest way to mount your GoPro\nMinimalist design for compact, low-profile mounting\nEnables optimal audio capture during low-speed activities\nAllows full-time access to all camera ports for convenient data offload, live-feed video and charging\nIntegrated latch makes removing the camera quick and easy\nExtendable support arm allows you to easily attach an LCD Touch BacPac&#8482; or Battery BacPac&#8482;1\nIncludes a glass Protective Lens to help guard the camera lens from dirt, dust and scratches\n\nNote: The Frame is not waterproof and not intended for use in extreme conditions where dirt and sharp objects can damage the camera lens. ', '', 1, 2860, '', '', NULL, NULL, NULL, 'Gopro The Frame', NULL, 'Access - Gopro The Frame,Gopro The Frame,Gopro ,Gopro India,Gopro Access,Gopro Mumbai,Gopro  Mumbai,Gopro Cameras Mumbai,Gopro Cameras India,Gopro Accessories Mumbai,Gopro Accessories India,Gopro Mounts Mumbai,Gopro Mounts India', 0, 1, 'ANDFR-302', 'The Frame', '818279010718', '', 'Mounts', 'HERO4 Black, HERO4 Silver, HERO3+, HERO3', '', '', '', '', '', '', '', '', '', 'The Frame\nProtective Lens\nQuick Release Buckle\nThumb Screw', '', 'z18A-WVdYA8', 'The Frame', '', '', 'No  Warranty', '', '', '', '', '', '', '', '', '', 'Gopro Mounts', '', '', '', '', 0, '12.5'),
(545, 'GoPro Dual Battery Charger & Battery', '', 'Conveniently charge your HERO4 Black or HERO4 Silver camera batteries with the Dual Battery Charger, the only GoPro charger that allows you to charge two HERO4 Black or HERO4 Silver batteries simultaneously. Featuring USB compatibility, you can power it with most standard USB power adapters, the GoPro Auto or Wall Charger or a computer. Dual LED indicator lights display the charging status, so you know when your batteries are ready for action. Includes a spare 1160mAh lithium-ion rechargeable battery for your HERO4 Black or HERO4 Silver camera.\nConveniently charges two HERO4 Black or HERO4 Silver camera batteries simultaneously\nCan be powered with most standard USB power adapters, the GoPro Auto or Wall Charger or a computer\nDual LED lights display charging status of both batteries\nAllows you to charge your spare batteries while you use your camera\nIncludes a spare 1160mAh lithium-ion rechargeable battery for your HERO4 Black or HERO4 Silver camera', '', 1, 4825, '', '', NULL, NULL, NULL, 'Gopro Dual Battery Charger & Battery', NULL, 'Access - Gopro Dual Battery Charger & Battery,Gopro Dual Battery Charger & Battery,Gopro ,Gopro India,Gopro Access,Gopro Mumbai,Gopro  Mumbai,Gopro Cameras Mumbai,Gopro Cameras India,Gopro Accessories Mumbai,Gopro Accessories India,Gopro Mounts Mumbai,Gop', 0, 1, 'AHBBP-401', 'Dual Battery Charger', '81879010350', '', 'Accessories', 'HERO4 Black, HERO4 Silver', '', '', '', '', '', '', '', '', '', 'Dual Battery Charger (for HERO4 Black/HERO4 Silver)\nRechargeable Battery (for HERO4 Black/HERO4 Silver)\nUSB Cable', '', '', 'Dual Battery Charger & Battery', '', '', '1 Year Warranty', '', '', '', 'No Warranty on Physical Damage', '', '', '', '', '', 'Gopro accessories', '', '', '', '', 0, '12.5'),
(546, 'GoPro The Strap', '', 'Strap your GoPro to your hand, wrist, arm or leg to capture hands-free ultra immersive POV footage, one-of-a-kind selfies and more. Includes an extended strap that fits around your arm, leg or larger objects. Features 360', '', 1, 4205, '', '', NULL, NULL, NULL, 'Gopro The Strap', NULL, 'Access - Gopro The Strap,Gopro The Strap,Gopro ,Gopro India,Gopro Access,Gopro Mumbai,Gopro  Mumbai,Gopro Cameras Mumbai,Gopro Cameras India,Gopro Accessories Mumbai,Gopro Accessories India,Gopro Mounts Mumbai,Gopro Mounts India', 1, 1, 'AHWBM-001', 'The Strap', '818279013979', '', 'Mounts', 'All GoPro cameras', '', '', '', '', '', '', '', '', '', 'Rotating Mount\nHand Strap\nWrist Strap\nArm + Leg Strap', '', 'mdigZJL7hMQ', 'The Strap', '', '', 'No  Warranty', '', '', '', '', '', '', '', '', '', 'Gopro Mounts', '', '', '', '', 0, '12.5'),
(547, 'GoPro Casey', '', 'Casey is the perfect travel and storage solution for your GoPro. It&#39;s small enough to fit inside a backpack, but large enough to carry your HERO cameras, plus essential mounts and accessories. The weather-resistant, semi-rigid shell guards against light rain and snow. A padded interior protects your camera, while removable dividers let you create customized compartments for any gear setup. Includes a pull-out pouch for smaller grab-and-go accessories like batteries, thumb screws, microSD cards and more.\nConveniently keep your GoPro, mounts and accessories together all in one place\nFully customizable to fit any gear setup\nDurable, semi-rigid shell and padded inner walls protect and cushion gear\nWeather-resistant design guards against light rain and snow\nFeatures a removable pouch that&#39;s perfect for storing batteries, thumb screws, microSD cards and more', '', 1, 3580, '', '', NULL, NULL, NULL, 'Gopro Casey', NULL, 'Access - Gopro Casey,Gopro Casey,Gopro ,Gopro India,Gopro Access,Gopro Mumbai,Gopro  Mumbai,Gopro Cameras Mumbai,Gopro Cameras India,Gopro Accessories Mumbai,Gopro Accessories India,Gopro Mounts Mumbai,Gopro Mounts India', 1, 1, 'ABSSC-001', 'Casey', '818279014044', '', 'Accessories', 'All GoPro cameras', '', '', '', '', '', '', '', '', '', 'Casey (Camera + Mounts + Accessories Case)\nPull-Out Pouch', '', '', 'Casey', '', '', 'No  Warranty', '', '', '', '', '', '', '', '', '', 'Gopro accessories', '', '', '', '', 0, '12.5'),
(548, 'GoPro Gooseneck', '', 'This bendable neck delivers versatile camera-angle adjustability, making it easy to capture a wide range of perspectives. Combine it with any GoPro mount that features a quick release base&#9472;including the Suction Cup, Jaws: Flex Clamp, Curved + Flat Adhesive Mounts and more&#9472;or use it on its own as a handheld camera grip. Multiple Goosenecks can be joined together for extended length and flexibility. Measures 8&#34; (20.3cm).\nDelivers versatile camera-angle adjustability to capture a wide range of perspectives\nCan be attached to any GoPro mount that features a quick release base\nDoubles as an adjustable handheld camera grip\nMakes it possible to elevate the camera above the mounting surface to achieve a higher perspective\nIdeal for capturing hard-to-reach shots around corners or over obstacles\nMultiple Goosenecks can be joined together for longer reach and greater flexibility\nMeasures 8&#34; (20.3cm)', '', 1, 1525, '', '', NULL, NULL, NULL, 'GoPro Gooseneck', NULL, 'Access - GoPro Gooseneck,GoPro Gooseneck,GoPro ,GoPro India,GoPro Access,GoPro Mumbai,GoPro  Mumbai,GoPro Cameras Mumbai,GoPro Cameras India,GoPro Accessories Mumbai,GoPro Accessories India,GoPro Mounts Mumbai,GoPro Mounts India', 1, 1, 'ACMFN-001', 'Gooseneck', '818279012064', '', 'Mounts', 'All GoPro cameras', '', '', '', '', '', '', '', '', '', 'Gooseneck', '', '', 'Gooseneck', '', '', 'No  Warranty', '', '', '', '', '', '', '', '', '', 'Gopro Mounts', '', '', '', '', 0, '12.5'),
(549, 'GoPro Side Mount', '', 'Mount your GoPro to the side of helmets, vehicles, gear and more. 3-way adjustability makes aiming the camera easy.\nVersatile side-mounting solution for helmets, vehicles and gear\nOffers 3-way adjustability for a variety of shots and capture angles\nWarranty: 1 Year\n\nNote: Always select a helmet that meets the applicable safety standard when you use with a GoPro helmet mount. Always follow the helmet manufacturer&#39;s instructions on safe helmet use', '', 1, 1160, '', '', NULL, NULL, NULL, 'GoPro Side Mount', NULL, 'Access - GoPro Side Mount,GoPro Side Mount,GoPro ,GoPro India,GoPro Access,GoPro Mumbai,GoPro  Mumbai,GoPro Cameras Mumbai,GoPro Cameras India,GoPro Accessories Mumbai,GoPro Accessories India,GoPro Mounts Mumbai,GoPro Mounts India', 1, 1, 'AHEDM-001', 'Side Mount', '818279010305', '', 'Mounts', 'All GoPro cameras', '', '', '', '', '', '', '', '', '', 'Curved Adhesive Mount\nQuick Release Buckle\n3-Way Pivot Arm (Mounting Hardware)\nThumb Screw', '', '', 'Side Mount', '', '', 'No  Warranty', '', '', '', '', '', '', '', '', '', 'Gopro Mounts', '', '', '', '', 0, '12.5'),
(550, 'GoPro Wrist Housing', '', 'Wear your GoPro like a watch for easy access when capturing footage on the fly. The Wrist Housing secures the camera flat against your wrist, yet lets you quickly pivot it upright to shoot photos or video. When not recording, you&#39;ll have full use of both hands, making it perfect for surfing, snorkeling, climbing and skiing. Fits over ski gloves or jackets with the included adapter, plus straps to kayak paddles, kitesurfing kites and other gear for a wide range of shooting possibilities. Waterproof to 197&#39; (60m).\nSecures camera flat against your wrist for hands-free convenience\nEnables you to quickly pivot camera upright to capture video and photos\nFits over ski gloves and jackets with included adapter\nCan be secured to paddles, kitesurfing kites and other gear\nWaterproof to 197&#39; (60m)', '', 1, 3580, '', '', NULL, NULL, NULL, 'GoPro Wrist Housing', NULL, 'Access - GoPro Wrist Housing,GoPro Wrist Housing,GoPro ,GoPro India,GoPro Access,GoPro Mumbai,GoPro  Mumbai,GoPro Cameras Mumbai,GoPro Cameras India,GoPro Accessories Mumbai,GoPro Accessories India,GoPro Mounts Mumbai,GoPro Mounts India', 1, 1, 'AHDWH-301', 'Wrist Housing', '818279010213', '', 'Mounts', 'HERO4 Black, HERO4 Silver, HERO3+ and HERO3. Touch display functionality not accessible on HERO4 Silver.', '', '', '', '', '', '', '', '', '', 'Wrist Housing\nNeoprene/Velcro Wrist Strap\nWrist Strap Adapter\nStandard Backdoor\nSkeleton Backdoor\nBacPac Backdoor', '', 'FZRNSa7KtlM', 'Wrist Housing', '', '', 'No  Warranty', '', '', '', '', '', '', '', '', '', 'Gopro Mounts', '', '', '', '', 0, '12.5'),
(551, 'GoPro Battery BacPac', '', 'The Battery BacPac is a removable battery pack that seamlessly attaches to the back of your GoPro to increase battery life. Now featuring 15% more battery capacity than the previous model, it&#39;s perfect for all-day adventures, marathon surf sessions or any application where you need extended battery life. It&#39;s also ideal for activities where charging or swapping in a fresh battery is difficult, like scuba diving and overnight backpacking. You can charge it with any standard USB charger, the GoPro Auto or Wall Charger,1 or a computer.2\nSeamlessly attaches to the back of your GoPro to extend battery life\nFeatures 15% more battery life than the previous model\nPerfect for any application where you need extended battery life\nCompact design keeps your GoPro as small and light as possible\nLCD window displays battery level or charging status\nLED light displays recording status\nCan be charged with most standard USB chargers, the GoPro Auto or Wall Charger,1 or a computer2 using the included USB cable\nCompatible for use with your Standard Housing with the included BacPac&#8482; Backdoors', '', 1, 4825, '', '', NULL, NULL, NULL, 'GoPro Battery BacPac', NULL, 'Access - GoPro Battery BacPac,GoPro Battery BacPac,GoPro ,GoPro India,GoPro Access,GoPro Mumbai,GoPro  Mumbai,GoPro Cameras Mumbai,GoPro Cameras India,GoPro Accessories Mumbai,GoPro Accessories India,GoPro Mounts Mumbai,GoPro Mounts India', 1, 1, 'ABPAK-401', 'Battery BacPac', '818279012545', '', 'Accessories', 'HERO4 Black, HERO4 Silver, HERO3+, HERO3', '', '', '', '', '', '', '', '', '', 'Battery BacPac&#8482;\nStandard BacPac Backdoor\nSkeleton BacPac Backdoor\nUSB Cable\nMounting Hardware\nProtective Case', '', '', 'Battery BacPac', '', '', '1 Year Warranty', '', '', '', 'No Warranty on Physical Damage', '', '', '', '', '', 'Gopro accessories', '', '', '', '', 0, '12.5'),
(552, 'GoPro Floaty Backdoor', '', 'This easy-to-spot flotation attaches directly to the housing backdoor to keep your GoPro afloat. Great for snorkeling, surfing, wakeboarding or other deep-water activity. Includes two adhesive anchors and camera tethers for added security in extreme conditions.\nEasy-to-spot flotation attaches directly to the housing backdoor\nGreat for snorkeling, surfing, wakeboarding or other deep-water activity\nIncludes two adhesive anchors and camera tethers for added security in extreme conditions\nIncludes spare backdoors for the Standard Housing and Dive Housing\n\nNote: The Floaty Backdoor will not support the weight of the Suction Cup mount, or the additional weight of BacPac&#8482; accessories attached to your GoPro', '', 1, 1525, '', '', NULL, NULL, NULL, 'GoPro Floaty Backdoor', NULL, 'Access - GoPro Floaty Backdoor,GoPro Floaty Backdoor,GoPro ,GoPro India,GoPro Access,GoPro Mumbai,GoPro  Mumbai,GoPro Cameras Mumbai,GoPro Cameras India,GoPro Accessories Mumbai,GoPro Accessories India,GoPro Mounts Mumbai,GoPro Mounts India', 1, 1, 'AFLTY-003', 'Floaty Backdoor', '818279010985', '', 'Accessories', ' HERO4 Black, HERO4 Silver, HERO3+, HERO3, HERO+ LCD, HERO+, HERO, HD HERO2, Original HD HERO', '', '', '', '', '', '', '', '', '', 'Floaty\nDive Housing Backdoor\nStandard Housing Backdoor\n2 Adhesive Anchors\n2 Camera Tethers', '', '', 'Floaty Backdoor', '', '', 'No  Warranty', '', '', '', '', '', '', '', '', '', 'Gopro accessories', '', '', '', '', 0, '12.5'),
(553, 'GoPro Anti-Fog Inserts', '', 'Drop these Anti-Fog Inserts into the sides of your GoPro camera housing to prevent fogging in cold and humid environments. Inserts will last up to four uses. To dry out and reuse, heat inserts on a pan in oven at 300', '', 1, 1160, '', '', NULL, NULL, NULL, 'GoPro Anti-Fog Inserts', NULL, 'Access - GoPro Anti-Fog Inserts,GoPro Anti-Fog Inserts,GoPro ,GoPro India,GoPro Access,GoPro Mumbai,GoPro  Mumbai,GoPro Cameras Mumbai,GoPro Cameras India,GoPro Accessories Mumbai,GoPro Accessories India,GoPro Mounts Mumbai,GoPro Mounts India', 0, 1, 'AHDAF-301', 'Anti-Fog Inserts', '818279010121', '', 'Accessories', 'HERO4 Black, HERO4 Silver, HERO3+, HERO3, HD HERO2, Original HD HERO', '', '', '', '', '', '', '', '', '', '12 Anti-Fog Inserts', '', '9Em__oNF8v0', 'Anti-Fog Inserts', '', '', 'No  Warranty', '', '', '', '', '', '', '', '', '', 'Gopro accessories', '', '', '', '', 0, '12.5'),
(554, 'GoPro Protective Lens & Covers', '', 'This kit includes a glass Protective Lens that fits over your GoPro camera lens to help guard against dirt, dust, and scratches while using the camera outside the housing. It&#39;s perfect for use with The Frame1 or handheld shooting with just the camera. Also includes a camera lens cover, Standard Housing lens cover, replacement battery door and replacement side door for your camera.\nProtective Lens helps guard against dirt, dust and scratches while using your GoPro outside the housing\nIncludes lens covers for the camera and Standard Housing\nIncludes replacement battery door and side door for the camera', '', 1, 1525, '', '', NULL, NULL, NULL, 'GoPro Protective Lens & Covers', NULL, 'Access - GoPro Protective Lens & Covers,GoPro Protective Lens & Covers,GoPro ,GoPro India,GoPro Access,GoPro Mumbai,GoPro  Mumbai,GoPro Cameras Mumbai,GoPro Cameras India,GoPro Accessories Mumbai,GoPro Accessories India,GoPro Mounts Mumbai,GoPro Mounts In', 1, 1, 'ALCAK-302', 'Protective Lens & Covers', '', '', 'Accessories', 'HERO4 Black, HERO4 Silver, HERO3+ and HERO3. Housing lens cover is not compatible with the HERO3/Dive Housing.', '', '', '', '', '', '', '', '', '', 'Protective Lens\nCamera Lens Cover\nStandard Housing Lens Cover\nReplacement Battery Door\nReplacement Side Doo', '', '', 'Protective Lens & Covers', '', '', 'No  Warranty', '', '', '', '', '', '', '', '', '', 'Gopro accessories', '', '', '', '', 0, '12.5');
