(602, 'Parrot Zik 2.0 Wireless Headphone - Orange', '', 'When technology and design become one. The Parrot Zik 2.0 headphones are 17% lighter than the previous generation, their padded headband is thicker and your ears have more space thanks to the new cushions. Compatible with smartphones, tablets and computers, Parrot Zik 2.0 supports most audio codecs, particularly the AAC format. Built-in NFC technology enables them to automatically connect via Bluetooth with NFC smartphones. Flight mode enables up to 18 hours of autonomy with ANC on and music via jack cable -  it is ideal for long haul intercontinental flights. Eco mode enables up to 7 hours of autonomy with ANC on, music via jack cable and Parrot Concert Hall effect. The normal mode enables up to 6 hours of autonomy with ANC on, with Bluetooth music and Parrot Concert Hall. Smart Touch Panel. ', '', 1, 31500, '', '', NULL, NULL, NULL, '', NULL, '', 0, 1, '', 'Orange', '3520410026508', '', 'Over The Ear, Stereo, Noice Cancelling', 'Apple Phones, Apple Ipods, Apple Ipads, Samsung Phones', '', '', 'Orange', '', '', '', '', '', '', '1 Zik 2.0, 1 Li-Ion 830 mAh battery, 3 point mini-jack cable, 1 USB micro USB, 1 transport case, 1 quickstart guide.', '', 'Q48t9N9WT7o', 'Zik 2.0 Wireless', '', 'Approx. 270g', 'No Warranty', '', '', '', '', '', '', '', '', '', 'Zik 2.0 Wireless', '', '', 'With Microphone', '', 0, '5'),
