(614, 'Tucano Lato Backpack For Macbook 17 - Black', '', 'Backpack with unique style suitable for both the professional and the student heading back to school. An integrated laptop compartment holds laptops with screens up to 17&#34;. It&#39;s also compatible with 15 and 17 inch MacBooks. The inner scratch resistant pocket is ideal for tablets and for the iPad. The front pocket includes an organized panel to stor your smartphone and iPod equipped with convenient headphone holes. The side mesh pockets grant a quick access to an umbrella, a snack or a water bottle. Extra padding on the panel of the back and the shoulder straps provide added cushioning. And the weather gets hot the exclusive Air Mesh System on ...   more...', '', 1, 3500, '', '', '', '0000-00-00', '0000-00-00', '', '', '', 1, 1, 'BLABK', 'Black', '844668020686', '', 'Backpack', 'Laptop', 'Notebook 15, Notebook 17, Macbook Pro 15, MacBook Pro 15 with Retina display, Macbook Pro 17', 'Polyester', 'Black', '', '', '', '', '', '', '1', '', '', 'Lato', '', '', 'NO WARRANTY', '', '', '', '', '', '', '', '17', '', 'BLABK', '35 x 48 x 18', '', '', '', 0, '12.5'),
(615, 'Tucano Expanded Backpack For Macbook 17 - Grey', '', 'The Tucano Expanded Workout Backpack allows you to travel with ease with any 17&#34; MacBook Pros or up to 16&#34; Noteboooks. It features an inner, padded laptop compartment with Tucano&#39;s Anti-Shock System, Anti-Slip System, and Secure-Fit Pocket. The inside of the pouch is lined with neoprene to prevent any scuffs or scratches. It includes a pocket for documents as well as an organized front pouch for any accessories. It also has great ergonomic, adjustable shoulder straps.', '', 1, 5000, '', '', '', '0000-00-00', '0000-00-00', '', '', '', 1, 1, 'BEWOBK17G', 'Grey', '', '', 'Backpack', 'Laptop', 'Notebook 15, Notebook 17, Macbook Pro 15, MacBook Pro 15 with Retina display, Macbook Pro 18', 'Nylon', 'Grey', '', '', '', '', '', '', '', '', '', 'Expanded', '', '', 'NO WARRANTY', '', '', '', '', '', '', '', '17', '', 'BEWOBK17', '42 x 35x 16', '', '', '', 0, '12.5'),
