(624, 'Bling My Thing Vogue Back Case For Apple iPhone 6 - Gold', '', 'The Vogue Collection takes Bling My Thing back to its root: pure luxury BLING! The Brilliant series offers beautiful gradation designs brought by our Chief Designer, Ayano Kimura. The way she mixes 3 crystal colors is truly magical. 534 pieces of SS9 Xilion Rose crystals (2.6mm) are embedded individually to create the maximum light refraction while allowing colors to change subtly from top to bottom. Ayano chose various combinations of colors for the Brillian series but this Brillian Gold design takes the the concept of gold to the next level: by incorporating two of the special coated crystals,  Crystal Golden Shadow and Crystal Moonlight, she managed to create subtle, mysterious shimmering effect on the crystal surface. The result is pure elegance. The background case color also changes in color from top to bottom, matching the crystal colors.\n\n• Case color: Metallic gradation                                      \n\n• Swarovski® Crystals: Light Colorado Topaz, Crystal Golden Shadow, Crystal Moonlight\n\n• Individual crystal setting for every crystal ensuring excellent hold\n\n• Crested with a brushed metal emblem with BMT logo\n\n• FREE jewelry bag to protect your precious case                         \n\n• Designed for iPhone 6 (this products does not include iPhone 6)', '', 1, 11900, '', '', '', '0000-00-00', '0000-00-00', '', '', '', 1, 1, '', 'Gold', '', '', '', 'Phone', 'Apple iPhone 6', '', 'Gold', '', '', '', '', '', '', '', '', '', 'Vogue', '', '', 'No Warranty', '', '', '', '', '', '', '', '', '', 'Vogue 6', '', '', '', '', 0, ''),
(625, 'Tucano Leggero Flip Case For Samsung Tab 3 7.0 - Black', '', 'Tablet case made of soft leather-like PU, especially designed for Samsung Galaxy Tab 3 7.0. Thanks to the MagLocker system by Tucano, the magnetic metallic plate on the back, you can easily lock the front flap. Embedded magnetic lock to prevent undesired front cover opening. With a simple gesture Leggero turns into a handy tilt-free stand: to write, surf the Internet, watch movies and photos. Internal soft scratch-resistant microfiber lining.', '', 1, 2500, '', '', NULL, NULL, NULL, '', NULL, '', 1, 1, 'TAB-LS37', 'Black', '', '', 'Flip Case', 'Galaxy Tab 3 7.0', 'Samsung Tab 3 7.0', 'PU Leather', 'Black', '', '', '', '', '', '', '', '', '', 'Leggero', '', '', 'No Warranty', '', '', '', '', '', '', '', '', '', 'TAB-LS37', '', '', '', '', 0, '12.5');
