(668, 'Logitech Bluetooth Audio Adapter', '', 'Pair your smartphone and tablet simultaneously with multipoint Bluetooth&#174; wireless technology. Stream audio from either device to your speakers. Pair your device with one press of the convenient pairing button. The re-pairing is automatic for hassle-free experience. Connect powered speakers with RCA or 3.5mm inputs. You can use your PC speakers, a home stereo system or A/V receiver.  ', '', 1, 1995, '', '', NULL, NULL, NULL, '', NULL, '', 1, 1, '980-000915', 'Black', '97855105783', '', 'Speaker Accessories', 'Powered speakers with RCA or 3.5mm inputs:\nPC speakers\nhome stereo systems\nA/V receivers\n\nBluetooth devices:\nsmartphones\ntablets', '', '', 'Black', '', '', '', '', '', '', 'Bluetooth Audio Adapter\nRCA to 3.5mm cable\nPower cable\nUser documentation', '', '', 'Bluetooth audio adapter', '', '', '1 Year Warranty', '', '', '', ' Limited Hardware Warranty', '', '', '', '', '', '', '', '', '', '', 0, '5'),
(669, 'Logitech K380 Bluetooth Keyboard - Black', '', 'Enjoy the comfort and convenience of desktop typing on your smartphone, and tablet with this mobile keyboard.\n\nK380 Multi-Device is a wireless keyboard that connects to all Bluetooth&#174; wireless devices that support external keyboards.\n\n- Bluetooth wireless\n- Multi-platform/cross-platform\n- Windows&#174;, Mac, Chrome OS&#8482;, Android&#8482;, iOS. Take this compact, lightweight, Bluetooth keyboard anywhere in your home. Type wherever you like, on any compatible computer, phone or tablet. Connect up to three devices simultaneously, for example a Windows computer, an iPhone and an Android tablet. Simply touch a button to start typing on a different device. K380 Multi-Device recognizes each device and automatically maps keys to give you a familiar layout with your favorite shortcuts.\n\nBy detecting your specific device', '', 1, 2795, '', '', NULL, NULL, NULL, '', NULL, '', 1, 1, 'K380', 'Black', '97855117717', '', 'Mice & Keyboards', 'Bluetooth wireless computers or other devices that support external keyboards (HID profile).', '', '', 'Black', '', '', '', '', '', '', 'Keyboard\n2 AAA batteries (pre-installed)\nUser documentation', '', '', 'Bluetooth Keyboard', '', '423 g ', '1 Year Warranty', '', '', '', ' Limited Hardware Warranty', '', '', '', '', '', 'K380', '124*279*16mm', '', '', '', 0, '5'),
(670, 'Logitech K480 Bluetooth Keyboard - Black', '', 'A new type of keyboard for your computer-that also works with your smartphone or tablet.*\n- Bluetooth wireless\n- Multi-platform and cross-platform\n* Bluetooth wireless devices, which support external keyboards. Just turn the Easy-Switch dial to switch typing between three connected Bluetooth wireless devices. You&#39;ll find a familiar keyboard layout with all the shortcut keys you use the most. The integrated cradle holds your phone or tablet at just the right angle for you to read while you type.*\n* Most phones and tablets up to 10.5mm (0.4 inches) thick and 258mm (10 inches) wide.\n- For Windows, Mac or Chrome computers\n- For Android or iOS mobile devices. ', '', 1, 2795, '', '', NULL, NULL, NULL, '', NULL, '', 1, 1, 'K480', 'Black', '97855107626', '', 'Mice & Keyboards', 'Bluetooth wireless computers or mobile devices which support external keyboards ', '', '', 'Black', '', '', '', '', '', '', 'Keyboard\n2 AAA batteries (pre-installed)\nUser documentatio', '', '', 'Bluetooth Keyboard', '', '820 g', '1 Year Warranty', '', '', '', ' Limited Hardware Warranty', '', '', '', '', '', 'K480', '195*299*20mm', '', '', '', 0, '5'),
(672, 'Bowers&Wilkins T7 Wireless Portable Speaker - Black', '', 'Introducing the pick-up-and-play Hi-Fi speaker. T7 is our most portable, versatile wireless system yet. So now you can bring great sound to places other speakers can''t reach. It takes a lot of acoustic know-how to deliver great sound from a small system. And we’ve used every technological trick we know to make sure that T7 packs an amazing sonic punch for such a little speaker. With T7, you can stream audio directly from any Bluetooth-enabled PC, tablet or mobile phone, without the need for a Wi-Fi network. Just charge it up, and it''s good for 18 solid hours of playback. T7’s controls are designed to be as easy to use as possible. The speaker keeps buttons to a minimum, while an array of simple light signals and audio cues conveys basic functions quickly and intuitively.', '', 1, 29999, '', '23999', '', '0000-00-00', '0000-00-00', '', '', '', 1, 1, '', 'Black', '7.14346E+11', '', 'Portable, Bluetooth', 'Bluetooth Enabled Phones, Tablets and Laptops', '', '', 'Black', '', '', '', '', '', '', 'T7 Wireless Portable Speaker. Power supply and regional adapters. Literature pack.', '', 'EbEH0RbaNPI', 'T7 Wireless', '', 'Approx. 940 Gms', '2 Years Warranty', '', '', '', '2 years Manufacturer Warranty from the date of purchase', '', '', '', '', '', 'T7 Wireless', '', '', 'Without Microphone', '', 0, '5'),
