(711, 'GoPole Reach', '', 'Extend the capabilities of your GoPro by getting closer to the action and capturing unique angles. Capture selfies with ease or flip the camera around on the pivoting head to shoot your subject with stability and precision. The 4-Stage telescoping body makes Reach compact and portable at only 14 inch retracted. Integrated twist locks allow the Reach to be extended up to 40 inch. Use the included remote clip to attach the GoPro Smart Remote (GoPro SMart Remote Sold Seperately).\n', '', 1, 3830, '', '', '', '0000-00-00', '0000-00-00', '', '', '', 1, 1, 'GPR9', 'Reach', '6.39E+11', '', 'Mounts', 'All GoPro cameras', '', '', '', '', '', '', '', '', '', '1x Reach, 1x Hi-Torque Thumbscrew, 1x Wrist Strap, 1x Wi-Fi Remote Clip', '', '', 'Reach', '', '', 'No  Warranty', '', '', '', '', '', '', '', '', '', 'GoPole Mounts', '14 x 0.98 x 0.98 inches', '', '', '', 0, '12.5'),
(712, 'GoPole Evo', '', 'Transparent, telescoping & floating. Evo is an extension pole and floatation device made for GoPro cameras. When capturing selfies, the transparent design of Evo makes it seemingly invisible. 2-Stage telescoping design makes the Evo compact and portable at only 14 inch retracted. The watertight twist lock allows the Evo to extend up to 24 inch. Control your GoPro from your fingertips, perfect for capturing selfies. Use the included remote clip to attach the GoPro Smart Remote (GoPro SMart Remote Sold Seperately). ', '', 1, 3530, '', '', '', '0000-00-00', '0000-00-00', '', '', '', 1, 1, 'GPE10', 'Evo', '6.33E+11', '', 'Mounts', 'All GoPro cameras', '', '', '', '', '', '', '', '', '', '1x Evo, 1x Hi-Torque Thumbscrew, 1x Wrist Strap, 1x Wi-Fi Remote Clip', '', '', 'Evo', '', '', 'No  Warranty', '', '', '', '', '', '', '', '', '', 'GoPole Mounts', '13.78 x 0.98 x 0.98 inch', '', '', '', 0, '12.5'),
(713, 'GoPole Arm', '', 'Extension mount that attaches to any GoPro or GoPole mount. The Arm allows you to capture more of yourself and your surroundings in the frame. It can be used in 8 inch or 16 inch configurations. Notches allow Arm pieces to be locked together at 0 degree, 45 degree or-45 degree angles - or adjusted to anything in between.', '', 1, 1870, '', '', '', '0000-00-00', '0000-00-00', '', '', '', 1, 1, 'GPA14', 'Arm', '6.39E+11', '', 'Mounts', 'All GoPro cameras', '', '', '', '', '', '', '', '', '', '2x Extension Arms, 2x Hi-Torque Thumbscrews, 1x Small Hi-Torque Thumbscrew', '', '', 'Arm', '', '', 'No  Warranty', '', '', '', '', '', '', '', '', '', 'GoPole Mounts', '(2x) 8.0 x 0.49 x 0.49 inch', '', '', '', 0, '12.5'),
(714, 'GoPole Base', '', 'Base is a compact tripod that folds into 6 locking positions for use as a tabletop tripod for GoPro cameras or a support base for GoPole products. Use as a tabletop tripod for GoPro cameras or a support base for GoPole products.', '', 1, 2910, '', '', '', '0000-00-00', '0000-00-00', '', '', '', 1, 1, 'GPBAS15', 'Base', '6.16E+11', '', 'Mounts', 'All GoPro cameras', '', '', '', '', '', '', '', '', '', '1x Base, 1x Hi-Torque Thumbscrew', '', '', 'Base', '', '', 'No  Warranty', '', '', '', '', '', '', '', '', '', 'GoPole Mounts', '5.90 x 1.57 x 1.57 inch', '', '', '', 0, '12.5'),
(715, 'GoPole Venturecase', '', 'Weather resistant soft case that stores and protects up to two GoPro cameras while still leaving room for mounts and accessories. Store mounts, accessories, clips, remotes, batteries and more. Fits all GoPro HERO cameras, each compartment contains a camera strap to secure your GoPro during travel.', '', 1, 2910, '', '', '', '0000-00-00', '0000-00-00', '', '', '', 0, 1, 'GPVC17', 'Venturecase', '6.33E+11', '', 'Accessories', 'All GoPro cameras', '', '', '', '', '', '', '', '', '', '1x Venturecase', '', '', 'Venturecase', '', '', 'No  Warranty', '', '', '', '', '', '', '', '', '', 'GoPole Accessories', '7.09 x 3.25 x 7.09 inch', '', '', '', 0, '12.5'),
(716, 'GoPole Bobber', '', 'The Bobber is the first of its kind floating GoPro accessory. Designed to save your camera if dropped in the water, it doubles as a hand grip and a floatation device. Hi-Vis floating body makes the Bobber easy to spot in the water - even in rough surf. The Bobber floats all GoPro BacPac accessories with ease including LCD Touch BacPac, Battery BacPac, and even the Dual HERO system.', '', 1, 2000, '', '', '', '0000-00-00', '0000-00-00', '', '', '', 0, 0, 'GPB11', 'Bobber', '', '', 'Mounts', 'All GoPro cameras', '', '', '', '', '', '', '', '', '', '1x Bobber, 1x Hi-Torque Thumbscrew, 1x Wrist-Strap Attachment, 1x Carabiner Attachment', '', '', 'Bobber', '', '', 'No  Warranty', '', '', '', '', '', '', '', '', '', 'GoPole Mounts', '5.90 x 1.57 x 1.57 inch', '', '', '', 0, '12.5'),
(717, 'Knog Qudos Action Light - Silver', '', 'Designed for your GoPro camera with GoPro conversion mounts. The kit includes a GoPro mounting bracket and two mount screws. The cold shoe bracket included also provide a versatile two-in-one solution for use with digital SLR cameras and tripods. Surfing after sunset. Mountain biking at midnight. Diving to new depths - underwater and on the dance floor. With 400 lumens of light powered by 3 Cree LEDs, the Qudos action guarantees to highlight real. Just like the GoPro, Qudos action is waterproof to 40m. Built with a marine grade aluminium heat sink and faceplate, polycarbonate lens and sealed rear battery door, it will never leave you hanging out to dry. ', '', 1, 5700, '', '', '', '0000-00-00', '0000-00-00', '', '', '', 1, 1, '11626', 'Silver', '9.33E+12', '', 'Accessories', 'All GoPro cameras', '', '', '', '', '', '', '', '', '', 'Action Camera Mount Bracket and Hardware, Cold Shoe/Tripod Adaptor (for use with DSLR cameras), Rechargeable battery & USB Recharge Cable.\n', '', '', 'Qudos Action', '', 'Approx. 150g', '1 Year Warranty', '', '', '', '', '', '', '', '', '', 'Knog Accessories', '31 x 70 x 40mm.', '', '', '', 0, '5'),
(718, 'Knog Qudos Action Light - Black', '', 'Designed for your GoPro camera with GoPro conversion mounts. The kit includes a GoPro mounting bracket and two mount screws. The cold shoe bracket included also provide a versatile two-in-one solution for use with digital SLR cameras and tripods. Surfing after sunset. Mountain biking at midnight. Diving to new depths - underwater and on the dance floor. With 400 lumens of light powered by 3 Cree LEDs, the Qudos action guarantees to highlight real. Just like the GoPro, Qudos action is waterproof to 40m. Built with a marine grade aluminium heat sink and faceplate, polycarbonate lens and sealed rear battery door, it will never leave you hanging out to dry.', '', 1, 5700, '', '', '', '0000-00-00', '0000-00-00', '', '', '', 0, 1, '', 'Black', '', '', 'Accessories', 'All GoPro cameras', '', '', '', '', '', '', '', '', '', 'Action Camera Mount Bracket and Hardware, Cold Shoe/Tripod Adaptor (for use with DSLR cameras), Rechargeable battery & USB Recharge Cable.', '', '', 'Qudos Action', '', 'Approx. 150g', '1 Year Warranty', '', '', '', '', '', '', '', '', '', 'Knog Accessories', '31 x 70 x 40mm.', '', '', '', 0, '5'),
(719, 'Mymyk Sportsmyk', '', 'SportsMyk is a fully adjustable, mini-boom microphone that is securely attached to clothing or a helmet and allows you to capture your own sports commentary on the go. Actions speak louder with words. Robust and discrete design restricts unwanted noises normally associated with audio recordings on action cameras, and its flexible arm allows it to be positioned close to the mouth and avoids sweat death caused by body contact. ', '', 1, 4750, '', '', '', '0000-00-00', '0000-00-00', '', '', '', 1, 1, 'SPMFG', 'Sportsmyk', '9.37E+12', '', 'Accessories', 'Go Pro Compatible USB to 3.5mm TRS mic adaptor cable, to interface with all Go Pro cameras with a USB mic input.', '', '', '', '', '', '', '', '', '', 'Sportsmyk Mic', '', '', 'Sportsmyk', '', 'Approx. 26g', '1 Year Warranty', '', '', '', '', '', '', '', '', '', 'Mymyk Accessories', '', '', '', '', 0, '5'),
