(751, 'Blueair Sense+ Air Purifier - Polar White', '', 'Same great Sense, with added Wi-Fi for remote control from your smartphone. The new Sense+ combines cutting-edge technology, sleek design, and environmentally friendly credentials. Did you know indoor air can be up to 100 times more polluted than the air outside? The new Wi-Fi enabled Sense+ completely cleans your indoor air up to five times per hour, effectively removing impurities down to the tiniest particle. Lightening fast, the Sense+ removes 99.97% of pollutants in just ten minutes. Sense indicates when it is time to change the filter relative to usage and air pollution. Once changed simply touch the red light for a few seconds to reset it. To change a filter, turn the unit over and pull the handle located on the bottom of the unit. Padded handles double as the feet of the unit to prevent damage to hardwood floors. Get two powerful filtration styles in one. The Blueair Particle filter includes an added activated carbon screen to stop smoke and gas as well. Integrated Wi-Fi allows you to control the Sense+ with the Blueair Friend app on your smartphone. Adjust airflow speed, use the night mode, turn it on/off, and much more from anywhere, any time. Receive real time air quality readings and set up alerts and notifications specific to your needs. Room Size - 194 square feet. Airflow 35 - 84 - 150 cubic feet per minute. Air changes per hour - 5. Speed control options 1 - 2 - 3 - motion censored and smartphone control.', '', 1, 44990, '', '', '', '0000-00-00', '0000-00-00', '', '', '', 1, 1, '', 'Polar White', '', '', 'Air Purifier', '', '', '', 'White', '', '', '', '', '', '', 'Sense+ Air Purifier with filter and power cable', '', '4VfoN6VauGI', 'Sense+', '', '11 kilograms', '5 Years warranty', '', '', '', 'No warranty on Filters', '', '', '', '', '', 'Sense+', '492 x 470 x 170 millimeters', '', '', '', 0, '5');
