(757, 'Blueair Sense Air Purifier Filter', '', 'Designed specifically to fit the original Blueair Sense and new Blueair Sense+. Our Sense Filters feature next generation technology, capturing 99.97% of harmful particles from the air down to 0.1 micron in size, with an added sheet of activated carbon. Fortified with a blend of Potassium Hydroxide (KOH) and Potassium Iodide (K1), the activated carbon traps odors, tobacco smoke, and dangerous VOCs. Using a combination of both electrostatic and mechanical filtration, Blueair filters are able to use less dense filter media. This means less effort is required to push the air through the filter, resulting in peak performance levels with whisper silent delivery. The Sense filter is progressive structure acts like many filters in one, trapping particles in a range of sizes while maintaining maximum airflow. The gradient structure resists clogging and will never re-release particles back into the air, even when the filter is heavily loaded. The polypropylene fibers in our filters are naturally waterproof and antibacterial to prevent bacteria and mold growth, so you will never add harmful particles back into the air. We designed our filter media to be less dense, meaning our filtration system requires lower air pressure and lower energy consumption. The Sense filter is 100% recyclable, so the only thing you are adding back into the environment is clean air.', '', 1, 5500, '', '', '', '0000-00-00', '0000-00-00', '', '', '', 1, 1, '', '', '', '', 'Air Purifier', '', '', '', '', '', '', '', '', '', '', '', '', '', 'Sense', '', '', 'No Warranty', '', '', '', '', '', '', '', '', '', 'Sense Filter', '', '', '', '', 0, '5'),
(758, 'Blueair Sense+ Air Purifier Filter', '', 'Designed specifically to fit the original Blueair Sense and new Blueair Sense+. Our Sense Filters feature next generation technology, capturing 99.97% of harmful particles from the air down to 0.1 micron in size, with an added sheet of activated carbon. Fortified with a blend of Potassium Hydroxide (KOH) and Potassium Iodide (K1), the activated carbon traps odors, tobacco smoke, and dangerous VOCs. Using a combination of both electrostatic and mechanical filtration, Blueair filters are able to use less dense filter media. This means less effort is required to push the air through the filter, resulting in peak performance levels with whisper silent delivery. The Sense filter is progressive structure acts like many filters in one, trapping particles in a range of sizes while maintaining maximum airflow. The gradient structure resists clogging and will never re-release particles back into the air, even when the filter is heavily loaded. The polypropylene fibers in our filters are naturally waterproof and antibacterial to prevent bacteria and mold growth, so you will never add harmful particles back into the air. We designed our filter media to be less dense, meaning our filtration system requires lower air pressure and lower energy consumption. The Sense filter is 100% recyclable, so the only thing you are adding back into the environment is clean air.', '', 1, 5500, '', '', '', '0000-00-00', '0000-00-00', '', '', '', 1, 1, '', '', '', '', 'Air Purifier', '', '', '', '', '', '', '', '', '', '', '', '', '', 'Sense+', '', '', 'No Warranty', '', '', '', '', '', '', '', '', '', 'Sense+ Filter', '', '', '', '', 0, '5'),
(759, 'Blueair 270E Air Purifier Particle Filter', '', 'Designed specifically to fit our 270E units. Blueair air purifiers combine electrostatic and mechanical filtration, allowing filtration to perform at peak performance levels for longer periods of time. The two types of filtration expertly work together to trap particles from big to small. The gradient filter structure resembles many filters in one, trapping particles of all sizes while maintaining maximum airflow. The progressive structure resists clogging and would not re-release particles back into the air, even when the filter is heavily loaded. The naturally antibacterial polypropylene fibers in our filters prevent bacteria and mold growth, so you will never add harmful particles back into the air. Our less dense filter design mean lower air pressure, requiring less energy consumption. Our filters are also 100% recyclable, so the only thing you are adding back into the environment is clean air. Due to the use of both electrostatic and mechanical filtration, our filters are able to benefit from lower density filter media. Less density allows lower air pressure, so you get high performance with a whisper silent delivery.', '', 1, 4500, '', '', '', '0000-00-00', '0000-00-00', '', '', '', 1, 1, '', '', '', '', 'Air Purifier', '', '', '', '', '', '', '', '', '', '', '', '', '', '270E', '', '', 'No Warranty', '', '', '', '', '', '', '', '', '', '270E Filter', '', '', '', '', 0, '5'),
(760, 'Blueair 270E Air Purifier SmokeStop Filter', '', 'Designed specifically to fit our 270E units. Blueair air purifiers combine electrostatic and mechanical filtration, allowing filtration to perform at peak performance levels for longer periods of time. The two types of filtration expertly work together to trap particles from big to small. We fortify our carbon with a blend of magnesium dioxide and copper oxide to produce the activated carbon used in our SmokeStop filters. The porous structure of carbon makes it ideal for trapping gas and odor, with one gram of activated carbon providing a surface area of over 1,000 square meters. The SmokeStop is specifically designed for environments with heavy gaseous pollutants, such as smoke, odors, and harmful VOCs. The gradient filter structure resembles many filters in one, trapping particles of all sizes while maintaining maximum airflow. The progressive structure resists clogging and would not re-release particles back into the air, even when the filter is heavily loaded. Our less dense filter design mean lower air pressure, requiring less energy consumption. Our filters are also 100% recyclable, so the only thing you are adding back into the environment is clean air. Due to the use of both electrostatic and mechanical filtration, our filters are able to benefit from lower density filter media. Less density allows lower air pressure, so you get high performance with a whisper silent delivery.', '', 1, 6000, '', '', '', '0000-00-00', '0000-00-00', '', '', '', 1, 1, '', '', '', '', 'Air Purifier', '', '', '', '', '', '', '', '', '', '', '', '', '', '270E', '', '', 'No Warranty', '', '', '', '', '', '', '', '', '', '270E Filter', '', '', '', '', 0, '5'),
