(777, 'GoPro Floaty for HERO4 Session', '', 'This easy-to-spot flotation wraps around your HERO4 Session to keep it afloat. It&#39;s specially designed to protect your camera, while also giving you easy access to the shutter button. Floaty is perfect for worry-free shooting in and around the water while surfing, snorkeling, wakeboarding and more. Includes an adhesive anchor and camera tether for added security in extreme conditions.\nThis easy-to-spot flotation wraps around your HERO4 Session to keep it afloat\nCushiony padding protects your camera\nGreat for snorkeling, surfing, wakeboarding or other water activities', '', 1, 1525, '', '', NULL, NULL, NULL, 'GoPro Floaty for HERO4 Session', NULL, 'Access - GoPro Floaty for HERO4 Session,GoPro Floaty,GoPro ,GoPro India,GoPro Access,GoPro Mumbai,GoPro  Mumbai,GoPro Cameras Mumbai,GoPro Cameras India,GoPro Accessories Mumbai,GoPro Accessories India,GoPro Mounts Mumbai,GoPro Mounts India', 1, 1, 'ARFLT-001', 'Floaty', '818279013870', '', 'Accessories', 'HERO4 Session', '', '', '', '', '', '', '', '', '', 'Floaty (for HERO4 Session)\nThumb Screw\nTether\nAdhesive Anchor', '', '', 'Floaty', '', '', 'No  Warranty', '', '', '', '', '', '', '', '', '', 'Gopro accessories', '', '', '', '', 0, '12.5'),
(778, 'GoPro The Frames for HERO4 Session', '', 'The Frames make it easy to attach your HERO4 Session to any GoPro mount. Includes a Standard Frame, plus a Low-Profile Frame that&#39;s optimized for helmet and ultra compact mounting. Both work great in all scenarios, making The Frames the most versatile and convenient way to mount your HERO4 Session.\nLets you use your HERO4 Session with any GoPro mount\nIncludes a Standard Frame, plus a Low-Profile Frame for helmet and ultra compact mounting\nCamera can be positioned multiple ways in the frame for increased mounting flexibility\nProvides easy access to the shutter button and camera ports in most mounting configurations\nIntegrated latches make it easy to install and remove the camera from your mounting setup\n \nNote: Always select a helmet that meets the applicable safety standard when you use with a GoPro helmet mount. Always follow the helmet manufacturer&#39;s instructions on safe helmet use.', '', 1, 2860, '', '', NULL, NULL, NULL, 'GoPro The Frames for HERO4 Session', NULL, 'Access - GoPro The Frames for HERO4 Session,GoPro The Frames,GoPro ,GoPro India,GoPro Access,GoPro Mumbai,GoPro  Mumbai,GoPro Cameras Mumbai,GoPro Cameras India,GoPro Accessories Mumbai,GoPro Accessories India,GoPro Mounts Mumbai,GoPro Mounts India', 1, 1, 'ARFRM-001', 'The Frame', '', '', 'Mounts', 'HERO4 Session', '', '', '', '', '', '', '', '', '', 'Standard Frame\nLow-Profile Frame\nMounting Buckles\n2 Thumb Screws', '', '', 'The Frames', '', '', 'No  Warranty', '', '', '', '', '', '', '', '', '', 'Gopro Mounts', '', '', '', '', 0, '12.5'),
(779, 'GoPro The Jam', '', 'Mount your GoPro to almost anything on stage to give you and your fans an immersive new perspective of performances, rehearsals and jam sessions. The Jam can be used on guitar headstocks, drum hoops, keyboards, brass instruments, mic stands and more. Its highly adjustable design can be customized to three different lengths for extreme capture flexibility. The ability to grip countless objects, including super slim shapes, makes it a great mounting option for activities beyond music. \nMounts to guitars, drums, mic stands and more\nLightweight, highly adjustable design\nCustomizable to three different lengths\nVersatile mounting for a wide range of activities beyond music', '', 1, 4915, '', '', NULL, NULL, NULL, 'GoPro The Jam', NULL, 'Access - GoPro The Jam,GoPro The Jam,GoPro ,GoPro India,GoPro Access,GoPro Mumbai,GoPro  Mumbai,GoPro Cameras Mumbai,GoPro Cameras India,GoPro Accessories Mumbai,GoPro Accessories India,GoPro Mounts Mumbai,GoPro Mounts India', 1, 1, 'AMCLP-001', 'The Jam', '', '', 'Mounts', 'All GoPro cameras', '', '', '', '', '', '', '', '', '', '', '', 'T9xCQIfYmX0', 'The Jam', '', '', 'No  Warranty', '', '', '', '', '', '', '', '', '', 'Gopro Mounts', '', '', '', '', 0, '12.5'),
(780, 'GoPro Lens Replacement Kit for HERO4 Session', '', 'This kit contains everything you need to replace the glass lens cover on your HERO4 Session. Includes two replacement lens covers, seals, screws and a screwdriver for hassle-free repairs.\nContains everything needed to replace the HERO4 Session glass lens cover\nIncludes two replacement lens covers, seals, screws and a screwdriver', '', 1, 2860, '', '', NULL, NULL, NULL, 'GoPro Lens Replacement Kit for HERO4 Session', NULL, 'Access - GoPro Lens Replacement Kit for HERO4 Session,GoPro Lens Replacement Kit,GoPro ,GoPro India,GoPro Access,GoPro Mumbai,GoPro  Mumbai,GoPro Cameras Mumbai,GoPro Cameras India,GoPro Accessories Mumbai,GoPro Accessories India,GoPro Mounts Mumbai,GoPro', 1, 1, 'ARLRK-001', 'Lens Replacement Kit', '', '', 'Accessories', 'HERO4 Session', '', '', '', '', '', '', '', '', '', '2 Glass Lens Covers\n2 Seals\nSet of Screws\nScrewdriver', '', '', 'Lens Replacement Kit', '', '', 'No  Warranty', '', '', '', '', '', '', '', '', '', 'Gopro accessories', '', '', '', '', 0, '12.5'),
(781, 'GoPro 3.5mm Mic Adapter', '', 'Use this adapter to connect any 3.5mm external microphone to your GoPro for enhanced audio capture.\nConnects any 3.5mm mic to your GoPro', '', 1, 1525, '', '', NULL, NULL, NULL, 'GoPro 3.5mm Mic Adapter', NULL, 'Access - GoPro 3.5mm Mic Adapter,GoPro 3.5mm Mic Adapter,GoPro ,GoPro India,GoPro Access,GoPro Mumbai,GoPro  Mumbai,GoPro Cameras Mumbai,GoPro Cameras India,GoPro Accessories Mumbai,GoPro Accessories India,GoPro Mounts Mumbai,GoPro Mounts India', 1, 1, 'AMCCC-301', '3.5mm Mic Adapter', '818279010183', '', 'Accessories', 'HERO4 Black, HERO4 Silver, HERO3+, HERO3', '', '', '', '', '', '', '', '', '', '3.5mm Mic Adapter Cable', '', '', '3.5mm Mic Adapter', '', '', 'No  Warranty', '', '', '', '', '', '', '', '', '', 'Gopro accessories', '', '', '', '', 0, '12.5'),
(782, 'GoPro Wall Charger', '', 'Charge two GoPro cameras simultaneously&#9472;anywhere in the world. The GoPro Wall Charger offers 2x faster charging of your GoPro batteries compared to charging with a USB cable and computer, plus you can charge and record simultaneously. Includes interchangeable AC plugs for US, UK, EU and AU style wall sockets.\nCharge up to two cameras at once\n1 amp per port for a quick charging solution\nSimultaneously record video or photos while charging\nIncludes AC plugs for US, UK, EU and AU style wall sockets\nWorks with most devices that can be charged via USB\n\nEnsure your device is compatible with the charger before use.', '', 1, 2860, '', '', NULL, NULL, NULL, 'GoPro Wall Charger', NULL, 'Access - GoPro Wall Charger,GoPro Wall Charger,GoPro ,GoPro India,GoPro Access,GoPro Mumbai,GoPro  Mumbai,GoPro Cameras Mumbai,GoPro Cameras India,GoPro Accessories Mumbai,GoPro Accessories India,GoPro Mounts Mumbai,GoPro Mounts India', 1, 1, 'AWALC-001', 'Wall Charger', '185323000422', '', 'Accessories', 'All GoPro cameras', '', '', '', '', '', '', '', '', '', 'Wall Charger\nUS-style Wall Adapter (&#34;Type A&#34;, 2-pin)\nEU-style Wall Adapter (&#34;Type C&#34;, Europlug)\nUK-style Wall Adapter (&#34;Type G&#34;, BS 1363)\nAU-style Wall Adapter (&#34;Type I&#34;, AS-3112)', '', '', 'Wall Charger', '', '', '1 Year Warranty', '', '', '', 'No Warranty on Physical Damage', '', '', '', '', '', 'Gopro accessories', '', '', '', '', 0, '12.5'),
(783, 'GoPro Auto Charger', '', 'Keep your GoPro charged while on the road. With dual USB ports, you can quickly charge two cameras at once, plus charge and record simultaneously. Also works with most devices that charge via USB.\nCharge up to two cameras at once\n1 amp per port for a quick charging solution\nSimultaneously record video or photos while charging\nCompatible with most devices that can be charged via USB\n\nEnsure your device is compatible with the charger before use.', '', 1, 2150, '', '', NULL, NULL, NULL, 'GoPro Auto Charger', NULL, 'Access - GoPro Auto Charger,GoPro Auto Charger,GoPro ,GoPro India,GoPro Access,GoPro Mumbai,GoPro  Mumbai,GoPro Cameras Mumbai,GoPro Cameras India,GoPro Accessories Mumbai,GoPro Accessories India,GoPro Mounts Mumbai,GoPro Mounts India', 1, 1, 'ACARC-001', 'Auto Charger', '185323000439', '', 'Accessories', 'All GoPro cameras', '', '', '', '', '', '', '', '', '', 'Auto Charger\n2 USB Cables', '', '', 'Auto Charger', '', '', '1 Year Warranty', '', '', '', 'No Warranty on Physical Damage', '', '', '', '', '', 'Gopro accessories', '', '', '', '', 0, '12.5'),
(784, 'GoPro BacPac Extension Cable', '', 'The BacPac&#8482; Extension Cable enables you to connect your LCD Touch BacPac&#8482; or Battery BacPac&#8482; to your GoPro from a distance. Set up shots and control the camera remotely with an LCD Touch BacPac, or swap in a new Battery BacPac without un-mounting the camera. It&#39;s perfect for quickly adjusting settings and framing shots in multicam setups or conveniently accessing your BacPac when the camera is mounted in a hard-to-reach location. 3&#39; (0.9m) length.\nConnect your LCD Touch BacPac or Battery BacPac to your GoPro from a distance \nRemotely frame shots, adjust settings or control your camera with an LCD Touch BacPac\nSwap in a fresh Battery BacPac for extended battery life without un-mounting the camera\nConveniently access BacPacs when the camera is mounted in a hard-to-reach location\nQuick, hard-wired solution for adjusting settings and framing shots in multicam setups\n3&#39; (0.9m) length', '', 1, 2860, '', '', NULL, NULL, NULL, 'GoPro BacPac Extension Cable', NULL, 'Access - GoPro BacPac Extension Cable,GoPro BacPac Extension Cable,GoPro ,GoPro India,GoPro Access,GoPro Mumbai,GoPro  Mumbai,GoPro Cameras Mumbai,GoPro Cameras India,GoPro Accessories Mumbai,GoPro Accessories India,GoPro Mounts Mumbai,GoPro Mounts India', 1, 1, 'AHBED-301', 'BacPac Extension Cable', '', '', 'Accessories', 'LCD Touch BacPac, Battery BacPac', '', '', '', '', '', '', '', '', '', 'BacPac&#8482; Extension Cable', '', '', 'BacPac Extension Cable', '', '', '1 Year Warranty', '', '', '', 'No Warranty on Physical Damage', '', '', '', '', '', 'Gopro accessories', '', '', '', '0.9m', 0, '12.5'),
(785, 'GoPro The Tool', '', 'The Tool makes it easy to tighten your GoPro thumb screws to prevent the camera from shifting during high-speed, high-vibration activities. Whether you&#39;re headed surfing, skydiving or off-road racing, The Tool delivers the extra torque you need to get your thumb screws tighter than you can by hand. It&#39;s perfect when mounting the camera using multiple extension arms, or adjusting thumb screws in cold conditions with numb fingers. Added bonus: The Tool doubles as a bottle opener, so you can use it to crack a cold one back in the parking lot.\nTighten your GoPro thumb screws more securely than by hand\nPrevents the camera from tilting up or down during high-speed, high-vibration activities\nIdeal for achieving stability while mounting the camera with multiple extension arms\nEasily adjust thumb screws in cold conditions despite numb fingers\nDoubles as a bottle opener for apr', '', 1, 355, '', '', NULL, NULL, NULL, 'GoPro The Tool', NULL, 'Access - GoPro The Tool,GoPro The Tool,GoPro ,GoPro India,GoPro Access,GoPro Mumbai,GoPro  Mumbai,GoPro Cameras Mumbai,GoPro Cameras India,GoPro Accessories Mumbai,GoPro Accessories India,GoPro Mounts Mumbai,GoPro Mounts India', 1, 1, 'ATSWR-301', 'The Tool', '818279011029', '', 'Accessories', 'All GoPro cameras', '', '', '', '', '', '', '', '', '', 'The Tool (Thumb Screw Wrench + Bottle Opener)', '', '', 'The Tool', '', '', 'No  Warranty', '', '', '', '', '', '', '', '', '', 'Gopro accessories', '', '', '', '', 0, '12.5'),
