(842, 'Shure SE846 Earphone - Clear', '', 'Quad High-Definition MicroDrivers: The SE846 delivers extended high-end clarity and unparalleled low-end performance. Evolved from personal monitor technology road-tested by pro musicians and fine-tuned by Shure engineers, the SE846 features a patent-pending design that includes a groundbreaking low-pass filter. This technology enables the deep low-end performance of a true subwoofer without sacrificing clarity or detail of mids or highs. Comfortable Sound Isolating sleeves block up to 37 dB of ambient noise, whether onstage or on-the-go. Customizable frequency response, detachable cables, and a wide variety of accessories ensure an unequalled, perfectly tailored listening experience for the most discerning audio enthusiast. QUAD HIGH-DEFINITION MICRODRIVERS WITH TRUE SUBWOOFER. UNMATCHED PERSONALIZATION AND COMFORT. DURABLE, SOPHISTICATED DESIGN. ', '', 1, 83700, '', '', NULL, NULL, NULL, '', NULL, '', 0, 1, '\nSE846-CL', 'Clear', '42406277471', '', 'In Ear, Stereo', 'Apple Phones, Apple Ipods, Apple Ipads, Samsung Phones', '', '', 'Clear', '', '', '', '', '', '', 'SE846, sleeve fit kit, 2 cases, 46inch and 64inch cables, cable clip, frequency response customization kit, airline and 1/4 inch adapters, volume control, and user guide', '', '', 'SE846', '', '', '1 Year Warranty', '', '', '', '1 year Manufacturer Warranty from the date of purchase', '', '', '', '', '', 'SE846', '', '', 'Without Microphone', '', 0, '5'),
