(846, 'Logitech UE Roll Wireless Portable Speaker - Black', '', 'UE ROLL is the 360-degree wireless Bluetooth speaker that brings unapologetically awesome sound to beaches, cliffs and mountains. UE ROLL was meant for a life of adventure, a life filled with trails, caves, lakes and mountains. Awesome sound for awesome adventures. Use the UE ROLL app to unlock even more awesome features for your speaker like Double Up, Block Party and more. IPX7 rated: UE ROLL can be immersed in liquid up to 1m for up to 30 minutes. Rechargeable Lithium-Ion Battery for up to 9 hours of battery life between Micro USB charges. Actual battery life will vary with use, settings and environmental conditions. Charge time: 5.5 hours. Connect up to two source devices at the same time. Wirelessly play (stream) to 2 UE ROLLs from one source. Mobile range of play is up to 20m or (65ft). Smartphones, tablets and other devices that support Bluetooth wireless audio profile or 3.5 mm audio output.', '', 1, 8495, '', '', '', '0000-00-00', '0000-00-00', '', '', '', 1, 1, '984000508', 'Black', '97855113948', '', 'Portable, Bluetooth', 'Bluetooth Enabled Phones, Tablets and Laptops', '', '', 'Black', '', '', '', '', '', '', 'UE Roll Speaker and Micro USB Cable', '', 'rp7nsKVI_Zk', 'UE Roll Wireless', '', 'Item Weight - 330 Gms', '1 Year warranty', '', '', '', '1 year Manufacturer Warranty from the date of purchase', '', '', '', '', '', 'UE Roll Wireless', '', '', 'Without Microphone', '', 0, '5'),
