(850, 'Shure SRH550DJ Headphone - Black', '', 'The SRH550DJ Headphones from Shure deliver full-range audio performance, comfort, and durability for DJ use and personal listening. 50 mm Dynamic drivers deliver enhanced bass, while padded ear cups with supra-aural design swivel 90 degrees for flexible wearing positions and full isolation. Closed-back, supra-aural design rests comfortably and securely on the ears with full isolation. Ultra-lightweight design folds to very small size for maximum portability. Replaceable ear pads ensure long product life. ', '', 1, 7740, '', '5500', NULL, NULL, NULL, '', NULL, '', 1, 1, '', 'Black', '42406199711', '', 'Over The Ear, Stereo', 'Apple Phones, Apple Ipods, Apple Ipads, Samsung Phones, DJ Consoles (With 6.5mm Adapter)', '', '', 'Black', '', '', '', '', '', '', 'SRH550DJ, threaded 1/4 inch gold-plated adapter, carrying bag, and user guide', '', '', 'SRH550DJ', '', '', '1 Year Warranty', '', '', '', '1 year Manufacturer Warranty from the date of purchase', '', '', '', '', '', 'SRH550DJ', '', '', 'Without Microphone', '', 0, '5'),
(851, 'Shure SRH750DJ Headphone - Black', '', 'The SRH750DJ Headphones from Shure deliver world-class audio performance, comfort, and durability to professional DJs. High impedance and maximized power handling optimize the headphones for use on high-output DJ mixers. Comfortable, padded ear cups swivel 90 degrees and allow easy placement on one ear when mixing. Replaceable cable and included set of replacement ear pads ensure a long product life. Enhanced frequency response tuned to deliver high-output bass with extended highs. Closed-back, circumaural design rests comfortably over the ears and reduces background noise. Bayonet Clip securely locks cable into ear cup. 3m coiled detachable cable provides plenty of length and easy storage. ', '', 1, 11520, '', '8000', NULL, NULL, NULL, '', NULL, '', 1, 1, '', 'Black', '42406171601', '', 'Over The Ear, Stereo', 'Apple Phones, Apple Ipods, Apple Ipads, Samsung Phones, DJ Consoles (With 6.5mm Adapter)', '', '', 'Black', '', '', '', '', '', '', 'SRH750DJ, threaded 1/4 inch gold-plated adapter, carrying bag, replacement ear pads, and user guide', '', '', 'SRH750DJ', '', '', '1 Year Warranty', '', '', '', '1 year Manufacturer Warranty from the date of purchase', '', '', '', '', '', 'SRH750DJ', '', '', 'Without Microphone', '', 0, '5'),
