(883, 'Parrot Rolling Spider MiniDrone - White', '', 'Parrot Rolling Spider is an ultra-compact flying drone with impressive agility. It flies indoor and outdoor with great speed and stability. It rips through the air, flips and thanks to its removable wheels, rolls from floor to ceiling. Parrot Rolling Spider is an ultra-compact drone controlled by smartphone. It flies indoors and outdoors with surprising speed and stability. Acrobatic tricks are available from the free app for MiniDrones FreeFlight 3. Free piloting app compatible with smartphones and tablets running on iOS, Android, and Windows Phone. 6 times lighter than AR.Drone and the same flight stability thanks to an autopilot based on a 3-axis gyroscope and 3-axis accelerometer. Rolling Spider s vertical camera enables you to take photos. You simply hit the photo icon on piloting screen to take snapshots. Range - Up to 20 meters. Battery - Lasts up 8 min (6 min with wheels) and full recharge in 90 mins.', '', 1, 14990, '', '', '', '0000-00-00', '0000-00-00', '', '', '', 0, 1, '', 'White', '3.52041E+12', '', '', 'iOS, Android - Smartphones/Tablets', '', '', 'White', '', '', '', '', '', '', '1 Rolling Spider, 1 battery, 2 wheels, 1 set of stickers, 1 quick start guide', '', 'v7Q1giJOpxA', 'Rolling Spider', '', 'Approx. without wheels 55g and 65g with wheels', '1 Year Warranty', '', '', '', '1 year Manufacturer Warranty from the date of purchase', '', '', '', '', '', 'Rolling Spider', 'Approx. 140mm', '', '', '', 0, '12.5'),
(884, 'Parrot Zik 3.0 Wireless Headphone - Black OverStitched', '', 'Zik 3 is the newest generation of Parrot s wireless music and telephony headset. To ensure music is heard in all its harmony and depth, Parrot Zik 3 audio playback offers a digital 32 bits audio processing. The frequency of the signal is fully customisable with the 5 band Pro-equalizer available on the free and specially designed app Parrot Zik. The Parrot Zik 3 offers the possibility to personalize the audio restitution of each song. Auto adaptive noise cancelling. Smart touch control. Set room simulation of Parrot Concert Hall Effect, set ANC, check battery level and optimize it through your smartwatch. Flight mode (ANC activated + line-in) -  18 hours. Eco mode (ANC activated + line-in + spatialization effect) -  7 hours. Charge your headset by simply placing it on the wireless Parrot charger (not included). Parrot Zik 3 is compatible with most certified Qi inductive chargers.', '', 1, 42000, '', '', NULL, NULL, NULL, '', NULL, '', 1, 1, '', 'Black OverStitched', '3520410035098', '', 'Over The Ear, Stereo, Noice Cancelling', 'Apple Phones, Apple Ipods, Apple Ipads, Samsung Phones', '', '', 'Black', '', '', '', '', '', '', '1 Zik 3.0 Headphones, 1 battery Li-Ion 830 mAh, 1 Line-in cable, 1 Micro USB cable, 1 Carrying pouch, 1 Quick start guide', '', 'FFIfcObVrrk', 'Zik 3.0 Wireless', '', 'Approx. 275g', 'No Warranty', '', '', '', '', '', '', '', '', '', 'Zik 3.0 Wireless', '', '', 'With Microphone', '', 0, '5'),
