(979, 'V-Moda XS Headphone - Matte Black', '', 'XS is the best pair of on-ear headphones available today. The Inner and outer rings of the diaphragm separate the bass from bleeding into the mids and highs This allows for wider clarity, vocals that sound life-like, crystal clear cymbals and crispy hi-hats. Its fit is everything. It breaks the conventional fit of headphones where it is presumed that heads and ears are round. The fit is the sound in this pair of headphones because there is no space between the head and the headphones and with pressure relief points at which they contour, one is sure to wear them for extended period comfortably. Steelflex Headband. Supple Memory Foam Cushions. Kevlar Reinforced Cable. Environment-Proof. Do not be fooled by the size of the XS. It can survive as many as 70+ drops from 1.5m onto concrete as tested by the folks at V-MODA. Cliqfold Hinge. Dual Inputs & V-CORK.\n', '', 1, 14990, '', '', NULL, NULL, NULL, '', NULL, '', 1, 1, '', 'Matte Black', '877653006198', '', 'On The Ear, Stereo', 'Apple Phones, Apple Ipods, Apple Ipads, Samsung Phones', '', '', 'Black', '', '', '', '', '', '', 'XS Headphone, Exoskeleton Hardcase, 1-Button Kevlar Reinforced SpeakEasy Mic Cable', '', 'eV58ORb-tD4', 'XS', '', 'Approx. 195g', '2 Years Warranty', '', '', '', '2 years Manufacturer Warranty from the date of purchase', '', '', '', '', '', 'XS', '', '', 'With Microphone', '', 0, '5'),
(980, 'V-Moda XS Headphone - White Silver', '', 'XS is the best pair of on-ear headphones available today. The Inner and outer rings of the diaphragm separate the bass from bleeding into the mids and highs This allows for wider clarity, vocals that sound life-like, crystal clear cymbals and crispy hi-hats. Its fit is everything. It breaks the conventional fit of headphones where it is presumed that heads and ears are round. The fit is the sound in this pair of headphones because there is no space between the head and the headphones and with pressure relief points at which they contour, one is sure to wear them for extended period comfortably. Steelflex Headband. Supple Memory Foam Cushions. Kevlar Reinforced Cable. Environment-Proof. Do not be fooled by the size of the XS. It can survive as many as 70+ drops from 1.5m onto concrete as tested by the folks at V-MODA. Cliqfold Hinge. Dual Inputs & V-CORK.\n', '', 1, 14990, '', '', NULL, NULL, NULL, '', NULL, '', 1, 1, '', 'White Silver', '877653006204', '', 'On The Ear, Stereo', 'Apple Phones, Apple Ipods, Apple Ipads, Samsung Phones', '', '', 'White', '', '', '', '', '', '', 'XS Headphone, Exoskeleton Hardcase, 1-Button Kevlar Reinforced SpeakEasy Mic Cable', '', 'eV58ORb-tD4', 'XS', '', 'Approx. 195g', '2 Years Warranty', '', '', '', '2 years Manufacturer Warranty from the date of purchase', '', '', '', '', '', 'XS', '', '', 'With Microphone', '', 0, '5'),
(981, 'V-Moda Crossfade M100 Headphone - Shadow', '', 'V-MODA s flagship M-100 is the result of 4 years of unending brainstorming and collective masterminding by the industry s experts from editors, Grammy-winning artists, DJs, travelers and audiophiles. The Inner and outer rings of the diaphragm separate the bass from bleeding into the mids and highs This allows for wider clarity, vocals that sound life-like, crystal clear cymbals and crispy hi-hats. Master crafted materials make the driver and components which are far superior and more expensive than other headphones available at this price range. Although the M-100 does not have an active noise cancellation feature, it is over-ear contoured earpads naturally cut out the distractions of jet engines, crying babies and crowd noise. The M-100 headphones has been made to ditch the 2 extra digital-to-analog conversions found in battery powered headphones because they pollute the listening experience. WIthout them, the sound is both powerful and pure. Steelflex Headband. Kevlar Reinforced Cable. Environment-Proof. Cliqfold Hinge. Dual Inputs & V-CORK.', '', 1, 21990, '', '', NULL, NULL, NULL, '', NULL, '', 1, 1, '', 'Shadow', '877653005252', '', 'Over The Ear, Stereo', 'Apple Phones, Apple Ipods, Apple Ipads, Samsung Phones', '', '', 'Black', '', '', '', '', '', '', 'Crossfade M100 Headphone, Exoskeleton Hardcase, 1-Button Kevlar Reinforced SpeakEasy Mic Cable, Shared Audio Cable, 1/4inch Pro Adapter', '', 'YpTqd_NYQnU', 'Crossfade M100', '', 'Approx. 280g', '2 Years Warranty', '', '', '', '2 years Manufacturer Warranty from the date of purchase', '', '', '', '', '', 'Crossfade M100', '', '', 'With Microphone', '', 0, '5'),
(982, 'V-Moda Crossfade Wireless Headphone - Gun-Metal Black', '', 'in order to keep the iconic V-MODA materials and shapes, the Crossfade Wireless went through years of precise engineering to design and tune wireless electronics. V-MODA s has improved the renowned Crossfade M-100 signature sound for virtually identical wired and wireless playback. The Inner and outer rings of the diaphragm separate the bass from bleeding into the mids and highs This allows for wider clarity, vocals that sound life-like, crystal clear cymbals and crispy hi-hats. A 3-Button control module on your headphone works just like the 3-Button remotes you are already familiar with. Control your volume, tracks and activate voice and call controls with a simple touch of your finger. Although the Crossfade Wireless does not have an active noise cancellation feature, it is over-ear contoured earpads naturally cut out the distractions of jet engines, crying babies and crowd noise. You can enjoy both wireless and wired sound. With a battery life of about 12 hours, you can use them with your Bluetooth devices. And when you run out of juice, attach a cable and use it for unlimited hours with virtually undistinguishable sound. Steelflex Headband. Environment-Proof. Dual Inputs & V-CORK.\n\n', '', 1, 24990, '', '', NULL, NULL, NULL, '', NULL, '', 1, 1, '', 'Gun-Metal Black', '877653006587', '', 'Over The Ear, Stereo', 'Apple Phones, Apple Ipods, Apple Ipads, Samsung Phones', '', '', 'Black', '', '', '', '', '', '', 'Crossfade Wireless Headphone, Exoskeleton Hardcase, 1-Button Kevlar Reinforced SpeakEasy Mic Cable, Micro USB Cable', '', '', 'Crossfade Wireless', '', 'Approx. 292g', '2 Years Warranty', '', '', '', '2 years Manufacturer Warranty from the date of purchase', '', '', '', '', '', 'Crossfade Wireless', '', '', 'With Microphone', '', 0, '5'),
