(995, 'Sphero 2 App-Enabled Ball - White', '', 'Meet Sphero - the app-enabled ball that does it all. Intelligent and well-rounded, Sphero lets you play, learn, and explore. Create obstacle courses, upgrade family game night with multiplayer fun, or learn to program with our free SPRK lessons. This virtually unstoppable companion is waterproof (With Silicon Cover - Sold Separately), pet-proof, and ready for any adventure. It s time to upgrade your play. Choose from over 30 apps and launch a whole new world of gameplay. The result is limitless possibilities for new types of connected play that meld the virtual and real worlds for a fun gaming experience. Geek out with the smartest toy on the block. Now faster and brighter than ever, this robot will change the way you play.', '', 1, 13500, '', '', '', '0000-00-00', '0000-00-00', '', '', '', 1, 1, '', 'White', '', '', '', 'iOS, Android - Bluetooth Enabled Smartphones/Tablets', '', '', 'White', '', '', '', '', '', '', 'Sphero, 2xBoards, Charger, Charging Station, User Manual', '', '43tctP24Xmo', '2', '', 'Approx. 770 Gms', 'No Warranty', '', '', '', '', '', '', '', '', '', 'Sphero', '', '', '', '', 0, '5'),
(996, 'Sphero Ollie App-Enabled Toy - White', '', 'Meet Ollie - the app-enabled robot driven by adrenaline. Launch over the competition at floor-warping speeds. Ollie is awesomely agile thanks to its tubular design. Spin, drift, and flip with app-powered tricks. Then switch up your ride with custom tires and hubcaps. Ollie is engineered for speed, programmed for tricks, and customized by you. Tough on the outside. Smart on the inside. It s polycarbonate shell protects its engine while the robot s design repels water. Drive it down the stairs, through the dirt, or straight into a wall. Ollie also has the brains to match its brawn. Onboard intelligence tracks distance, airtime, color preferences, trick combos, and more. It is time to upgrade your play.', '', 1, 12375, '', '', '', '0000-00-00', '0000-00-00', '', '', '', 0, 1, '', 'White', '', '', '', 'iOS, Android - Bluetooth Enabled Smartphones/Tablets', '', '', 'White', '', '', '', '', '', '', 'Ollie, 2xRubber Tires, 2xHubcaps,USB Cable, User Manual', '', 'Zi-5hbaGmuQ', 'Ollie', '', '', 'No Warranty', '', '', '', '', '', '', '', '', '', 'Sphero', '', '', '', '', 0, '5'),
(997, 'Sphero BB-8 App-Enabled Droid - White', '', 'Over the years, the magic of Star War has always lived on screen and in our imaginations. Thanks to our advancements in technology, we have made it possible to bring a new part of Star Wars - The Force Awaken into your home. Meet BB-8 - the app-enabled Droid that is as authentic as it is advanced. BB-8 has something unlike any other robot - an adaptive personality that changes as you play. Based on your interactions, BB-8 will show a range of expressions and even perk up when you give voice commands. Set it to patrol and watch your Droid explore autonomously, make up your own adventure and guide BB-8 yourself, or create and view holographic recordings. It is now possible to explore the galaxy with your own trusty Astromech Droid by your side. BB-8 is more than a toy - it s your companion. Guide your BB-8 with a smartphone or tablet. Record and view virtual holographic videos with BB-8.', '', 1, 16875, '', '', '', '0000-00-00', '0000-00-00', '', '', '', 1, 1, '', 'White', '', '', '', 'iOS, Android, Windows - Bluetooth Enabled Smartphones/Tablets', '', '', 'White', '', '', '', '', '', '', '', '', '-1Y2WfcCb4M', 'BB-8', '', '', 'No Warranty', '', '', '', '', '', '', '', '', '', 'Sphero', '', '', '', '', 0, '5'),
(998, 'Nespresso Inissia Krups - Black', '', 'Easy insertion and ejection of capsules, for use with Nespresso coffee capsules only. Compact brewing unit technology, Fast preheating time -  25 seconds, 19 Bar high pressure pump. 2 Programmable buttons for Espresso and lungo preparation. Removable 24 ounce water tank, folding cup tray accommodates tall recipe glasses. Used capsule container holds 9-11 used capsules.', '', 1, 21500, '', '', '', '0000-00-00', '0000-00-00', '', '', '', 1, 1, '', 'Black', '', '', '', '', '', '', 'Black', '', '', '', '', '', '', 'Nespresso Machine, 16 Mixed Pods Box, Quick Start Guide', '', 'NFzGz18kxuw', 'Inissia', 'Glossy', '2.4 Kgs', 'No Warranty', '', '', '', '', '', '', '', '', '', 'Inissia', '4.6 in x12.6 in x 9.1 in', '', '', '', 0, '5'),
(999, 'Nespresso Lattisima Touch Delonghi - Red', '', 'The new comer of Lattissima range, Lattissima Touch - the must-have/reference one-touch system. Lattissima Touch offers an exceptional convenience to enjoy at home the pleasure of many excellent coffee and milk recipes at the simple touch of a button. Just add your touch. Removable water tank: 30 Ounces. Removable fresh milk container: 11.84 Ounces. Used capsule container capacity: 9. Folding drip tray for Latte Macchiato glass. One button operation. Reduced heating up time - 25 seconds. Personalised drink option to memorise amount of coffe and milk required for your favourite drink option.', '', 1, 45000, '', '', '', '0000-00-00', '0000-00-00', '', '', '', 1, 1, '', 'Red', '', '', '', '', '', '', 'Red', '', '', '', '', '', '', 'Nespresso Machine, 16 Mixed Pods Box, Quick Start Guide', '', 'pm3usfaSiuE', 'Lattisima Touch', 'Glossy', '4.5 Kgs', 'No Warranty', '', '', '', '', '', '', '', '', '', 'Lattisima Touch', '6.8 in x 10.1 in x 12.5 in\n', '', '', '', 0, '5'),
(1000, 'Nespresso Coffee Pod Intensity 4 - Cosi', '', 'Pure Arabicas from East Africa, Central and South America make this coffee a delicate and balanced blend with cereals and lightly toasted notes enhanced by subtle fruity notes.', '', 1, 950, '', '', '', '0000-00-00', '0000-00-00', '', '', '', 1, 1, '', 'Cosi', '', '', '', '', '', '', 'Brown', '', '', '', '', '', '', '1 Box (10 Capsules)', '', '', 'Coffee Pod', '', '', '', '', '', '', '', '', '', '', '', '', 'Coffee Pod', '', '', '', '', 0, '12.5'),
(1001, 'Nespresso Coffee Pod Intensity 8 - Roma', '', 'The balance of lightly roasted South and Central American Arabicas with Robusta, gives Roma sweet and woody notes and a full, lasting taste on the palate.', '', 1, 950, '', '', '', '0000-00-00', '0000-00-00', '', '', '', 1, 1, '', 'Roma', '', '', '', '', '', '', 'Grey', '', '', '', '', '', '', '1 Box (10 Capsules)', '', '', 'Coffee Pod', '', '', '', '', '', '', '', '', '', '', '', '', 'Coffee Pod', '', '', '', '', 0, '12.5'),
(1002, 'Nespresso Coffee Pod Intensity 10 - Ristretto', '', 'A blend of South American and East African Arabicas, with a touch of Robusta, roasted separately to create the subtle fruity note of this full-bodied.', '', 1, 950, '', '', '', '0000-00-00', '0000-00-00', '', '', '', 1, 1, '', 'Ristretto', '', '', '', '', '', '', 'Black', '', '', '', '', '', '', '1 Box (10 Capsules)', '', '', 'Coffee Pod', '', '', '', '', '', '', '', '', '', '', '', '', 'Coffee Pod', '', '', '', '', 0, '12.5'),
(1003, 'Nespresso Coffee Pod Intensity 6 - Vanillio', '', 'A balanced harmony between the rich and the velvety aromas of vanilla and the mellow flavor of the livanto coffee. A blend distinguished by its full flavour, infinitely smooth and silky on the plate.', '', 1, 950, '', '', '', '0000-00-00', '0000-00-00', '', '', '', 1, 1, '', 'Vanillio', '', '', '', '', '', '', 'Cream', '', '', '', '', '', '', '1 Box (10 Capsules)', '', '', 'Coffee Pod', '', '', '', '', '', '', '', '', '', '', '', '', 'Coffee Pod', '', '', '', '', 0, '12.5'),
(1004, 'OSMO Gaming System', '', 'Osmo is an award-winning game system that will change the way your child interacts with the iPad by opening it up to hands-on play. Groundbreaking system encourages creative thinking and social interaction by expanding gameplay beyond the screen. Games can be played and even created by the whole family, anywhere, and on any surface. All four games can be downloaded for free from the iTune App store, only Word and Tangram require physical pieces', '', 1, 8400, '', '', '', '0000-00-00', '0000-00-00', '', '', '', 1, 1, '', '', '', '', '', 'iPad Air, iPad Mini, iPad (2nd, 3rd and4th Gen)', '', '', '', '', '', '', '', '', '', 'Osmo Base and Reflector, Tangram Game Pieces, Words Game Pieces, All 3 Apps', '', '', '', '', '', 'No Warranty', '', '', '', '', '', '', '', '', '', '', '5.5 in x 3.8 in x 9 in', '', '', '', 0, '12.5'),
(1005, '3Doodler 2 3D Printing Pen', '', 'Turn your sketches into amazing 3D sculptures. Slimmer, lighter and stronger than the original. Enhanced design and drive system for quieter and smoother operation. Dual speed control and a new continuous flow function for non-stop Doodling. New nozzle design for better performance and crisper Doodles.', '', 1, 16875, '', '', '', '0000-00-00', '0000-00-00', '', '', '', 1, 1, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '3Doodler 2.0 pen, power adaptor, quick-start guide, instruction manual, plastic strands (25 strands of ABS plastic + 25 strands of PLA plastic) and tools for cleaning, nozzle removal, and temperature adjustment.', '', 'emUlHFWcHck', '2', '', '', 'No Warranty', '', '', '', '', '', '', '', '', '', '', '3 in x 11.2 in x 5.2 in', '', '', '', 0, '12.5'),
(1006, 'Parrot Buzz Jumping Night Drone - White', '', 'Energetic, ultra-stable and easy to pilot, this astounding drone is equipped with two powerful LEDs for exploring in the dark. Be it at night or day, shed light on your path and get ready to perform incredible moves and create light and sounds effects with this animated Minidrone. Agile and lightweight Jumping Night MiniDrone with embedded VGA (480X640) mini camera - sends photos and videos directly to your smartphone or tablet, microphone and speaker capture and broadcast audio. Equipped with two LED lights for exploring in the dark, create light and sound effects and save them to 4GB internal memory. Free Flight 3 app gives you ultimate control from your smartphone or tablet. Removable Lithium-Polymer 550mAh battery lasts up to 20 minutes and recharges in 25 minutes (with 2.6A charger, not included).', '', 1, 22500, '', '', '', '0000-00-00', '0000-00-00', '', '', '', 1, 1, '', 'White', '', '', '', 'iOS, Android - Smartphones/Tablets', '', '', 'White', '', '', '', '', '', '', '1 Minidrone, 2 Spare Rubber Feet, 1 Micro USB Cable, Stickers, 1 Battery, 1 quick start guide', '', 'PpEF_916VBY', 'Buzz', '', '', 'No Warranty', '', '', '', '', '', '', '', '', '', 'Jumping Night Drone', '7.3 in x 6.1 in x 4.6 in', '', '', '', 0, '12.5'),
(1007, 'Parrot Diesel Jumping Night Drone - Blue', '', 'Energetic, ultra-stable and easy to pilot, this astounding drone is equipped with two powerful LEDs for exploring in the dark. Be it at night or day, shed light on your path and get ready to perform incredible moves and create light and sounds effects with this animated Minidrone. Agile and lightweight Jumping Night MiniDrone with embedded VGA (480X640) mini camera - sends photos and videos directly to your smartphone or tablet, microphone and speaker capture and broadcast audio. Equipped with two LED lights for exploring in the dark, create light and sound effects and save them to 4GB internal memory. Free Flight 3 app gives you ultimate control from your smartphone or tablet. Removable Lithium-Polymer 550mAh battery lasts up to 20 minutes and recharges in 25 minutes (with 2.6A charger, not included).', '', 1, 22500, '', '', '', '0000-00-00', '0000-00-00', '', '', '', 1, 1, '', 'Blue', '', '', '', 'iOS, Android - Smartphones/Tablets', '', '', 'Blue', '', '', '', '', '', '', '1 Minidrone, 2 Spare Rubber Feet, 1 Micro USB Cable, Stickers, 1 Battery, 1 quick start guide', '', 'PpEF_916VBY', 'Diesel', '', '', 'No Warranty', '', '', '', '', '', '', '', '', '', 'Jumping Night Drone', '7.3 in x 6.1 in x 4.6 in', '', '', '', 0, '12.5'),
(1008, 'Motorola IT6 Landline Phone with Answering Machine - Black', '', 'Inspired by creative engineering, the Motorola IT6 Series uses precision crafting and innovative materials making it the ultimate impossibly thin phone. The slim metal frame and unique crystal base ensure its seamless, striking form, while the 100 name and number phonebook, answering machine, and caller ID offer the functionality you need in a home phone. Every detail of the IT6 Series was crafted to give the optimal exquisite user experience. A large 2.2 inch LCD display, backlit keypad, and bigger buttons makes the IT6 easier than ever to see and use. Do not miss another important message. With up to 30 minutes of recording time, you can save or receive messages without fear that your caller will be cut off. ', '', 1, 12375, '', '', '', '0000-00-00', '0000-00-00', '', '', '', 1, 1, '', 'Black', '', '', '', '', '', '', 'Black', '', '', '', '', '', '', 'Cordless Handset and Base, Power Adapter, Telephone Line Cord, User Guide, Quick Start Guide', '', '', 'IT6', '', '', 'No Warranty', '', '', '', '', '', '', '', '', '', 'Motorola Landline Phone', '', '', '', '', 0, '12.5'),
(1009, 'Motorola IT6-2 Landline Phone with Answering Machine - Black', '', 'Inspired by creative engineering, the Motorola IT6-2 Series uses precision crafting and innovative materials making it the ultimate impossibly thin phone. The slim metal frame and unique crystal base ensure its seamless, striking form, while the 100 name and number phonebook, answering machine, and caller ID offer the functionality you need in a home phone. Every detail of the IT6-2 Series was crafted to give the optimal exquisite user experience. A large 2.2 inch LCD display, backlit keypad, and bigger buttons makes the IT6-2 easier than ever to see and use. Do not miss another important message. With up to 30 minutes of recording time, you can save or receive messages without fear that your caller will be cut off. Main line connected to the main base.', '', 1, 16875, '', '', '', '0000-00-00', '0000-00-00', '', '', '', 1, 1, '', 'Black', '', '', '', '', '', '', 'Black', '', '', '', '', '', '', 'Cordless Handset x 2 and Base x 2, Power Adapter, Telephone Line Cord, User Guide, Quick Start Guide', '', '', 'IT6-2', '', '', 'No Warranty', '', '', '', '', '', '', '', '', '', 'Motorola Landline Phone', '', '', '', '', 0, '12.5'),
(1010, 'B&O Beoplay H2 Headphone - Silver Cloud', '', 'Flexible, on-ear headphone with superior sound - and microphone and remote for hassle-free control.', '', 1, 14990, '', '', '', '0000-00-00', '0000-00-00', '', '', '', 1, 1, '', 'Silver Cloud', '5705260045963', '', 'On The Ear, Stereo', 'Apple Phones, Apple Ipods, Apple Ipads, Samsung Phones', '', '', 'White', '', '', '', '', '', '', 'BeoPlay H2 headphone, Cable with 3-button remote.', '', '', 'Beoplay H2', '', '', '2 Years Warranty', '', '', '', '2 years Manufacturer Warranty from the date of purchase', '', '', '', '', '', 'Beoplay H2', '', '', 'With Microphone', '', 0, '5'),
(1011, 'Motorola Moto Hint Mono Earphone With Case - Black', '', 'Moto Hint is a sophisticated earbud designed to be discrete. Improved eargel profile provides a snug fit and enhanced audio performance. Seamless Voice control - Make or receive call, run a quick Google search or get turn-by-turn directions by simply speaking - no buttons needed. Intelligent cal routing. Wireless charging case - Improved charging case with double the battery life. Charging moto hint while on the go and get up to 17 Hours of talktime. ', '', 1, 16875, '', '', '', '0000-00-00', '0000-00-00', '', '', '', 1, 1, '', 'Black', '', '', 'In Ear, Mono', 'Apple Phones, Apple Ipods, Apple Ipads, Samsung Phones', '', '', 'Black', '', '', '', '', '', '', 'Bluetooth Headset, Charging Case with Rechargeable Battery, Charging Cable, EarGels, Manual', '', '', 'Moto Hint', '', '', 'No Warranty', '', '', '', '', '', '', '', '', '', 'Moto Hint', '', '', 'With Microphone', '', 0, '12.5'),
