(1019, 'Magic Sing HD Karaoke ET23KH', '', 'Music, Melody, MIC Volume Adjustment. Echo, Key, Tempo Adjustment. Realtime Search Mode (Song Title, Artist, Number). Musical Notation Display. CDG Karaoke Support. Movie, Music Play Mode. Real Time Score. Three Level Scoring Mode (Beginner / Amature / Professional). Record & Playback (USB memory). Moving Picture Background. Display Duplicate Song Numbers. Song Repeat (Practice Mode). Random Playback. Continuous Play. Melody Instrument Change. Jump (Skips Prelude / Interlude). Song Reservation (20 Songs). Background Change. HDMI Support. Built-In Manual(Help). USB memory support. Video Output NTSC. Games. Auto Power Off.', '', 1, 28500, '', '', '', '0000-00-00', '0000-00-00', '', '', '', 1, 1, 'ET23KH', '', '', '', '', 'TV with HDMI or Composit port', '', '', '', '', '', '', '', '', '', 'Main Station, 2 x Wireless Microphones, Remote Control, HDTV Cable, Carry Bag, Karoke Handbook, AV Cable (RCA), AC Adaptor, Battery.', '', '', 'HD Karaoke', '', '', '1 Year Warranty', '', '', '', '1 year Manufacturer Warranty from the date of purchase', '', '', '', '', '', 'HD Karaoke', '143(W) x 192.5(H) x 59(D) mm', '', '', '', 0, '5'),
(1020, '94Fifty Basketball with Smart Sensors - Brown', '', 'Stop counting your makes and misses, 94Fifty will do it for you and then tell you exactly why. What The App + Smart Basketball Measures - Shooting Arc, Shot Release Speed, Dribble Intensity + Speed, Shot Backspin. The Smart Basketball that Improves the Skills Coaches Want. The 94Fifty App is available for both iOS and Android. It connects seamlessly with the 94Fifty Smart Sensor Basketball and is jam-packed with features and games. Adapts to skills for players age 7+ to elite levels. Ultra-Durable Indoor/Outdoor Skin - 8 Hour Battery Life - Water Resistant - Instant feedback on every shot and dribble - Up to 90 Foot (30 Meter) Range - Upgrade Sensor Software Through the Phone.', '', 1, 25000, '', '', '', '0000-00-00', '0000-00-00', '', '', '', 1, 1, '', 'Brown', '', '', '', 'iPhone 4S and later, iPad 3 and later, iPod Touch 5th and later', '', '', 'Brown', '', '', '', '', '', '', '94Fifty Basketball, Wireless Charging Pad, 94Fifty App to be downloaded from Apple Store', '', 'TU7fM6pUohc', 'Basketball', '', '', 'No Warranty', '', '', '', '', '', '', '', '', '', '', 'Medium Size (Size 6 - 28.5)', '', '', '', 0, '12.5');
